[689] = {name = "생명력 흡수", additional_info = "마나 55 20 야드 사정거리\n집중 (5 초 주문 시전 시간)\n[q]대상으로부터 매초마다 10의 생명력을 흡수합니다. 5 sec 동안 지속됩니다."},
[690] = {name = "불화살 II", additional_info = "마나 18 30 야드 사정거리\n3 초 주문 시전 시간\n[q]적을 강타하여 28 to 30의 화염 피해를 입힙니다."},
[691] = {name = "지옥사냥개 소환", additional_info = "100% (기본 마나 중)\n10 초 주문 시전 시간\n재료:\n영혼의 조각\n[q]지옥사냥개를 소환하여 부립니다."},
[693] = {name = "영혼석 창조 (최하급)", additional_info = "85% (기본 마나 중)\n3 초 주문 시전 시간\n재료:\n영혼의 조각\n[q]최하급 영혼석을 창조합니다. 영혼석엔 하나의 영혼을 담아 놓을 수 있습니다. 만약 영혼이 담겨진 채로 죽게 되면 대상은 400의 생명력과 700의 마나를 지닌 채로 부활할 수 있습니다.\n\n 창조된 물건은 접속 종료 후 15분이 지나면 사라집니다."},
[694] = {name = "도발의 일격", additional_info = "분노 10 근접 사정거리\n즉시 시전 2 분 재사용 대기시간\n근접 무기 필요\n전투 태세 필요\n[q]적에게 도발의 일격을 날려 22의 피해를 입히고 위협 수준을 증가시켜 6 sec 동안 자신에게 공격을 집중하도록 만듭니다."},
[695] = {name = "어둠의 화살", additional_info = "마나 40 30 야드 사정거리\n2.2 초 주문 시전 시간\n[q]적에게 어둠의 화살을 발사하여 26 to 32의 암흑 피해를 입힙니다."},
[696] = {name = "악마의 피부", additional_info = "마나 120\n즉시\n[q]방어도를 120만큼 증가시키고 5초마다 5의 생명력이 회복됩니다. 30 min 동안 지속됩니다."},
[697] = {name = "보이드워커 소환", additional_info = "100% (기본 마나 중)\n10 초 주문 시전 시간\n재료:\n영혼의 조각\n[q]보이드워커를 소환하여 부립니다."},
[698] = {name = "소환 의식", additional_info = "마나 300 30 야드 사정거리\n5 초 주문 시전 시간\n재료:\n영혼의 조각\n[q]대상 파티원을 소환하는 의식을 시작합니다. 의식을 수행하려면 흑마법사를 제외하고 파티원 2명이 필요합니다. 의식에 참가하려는 플레이어는 비전투 상태여야 하며 소환의 문에 오른쪽 클릭을 한 뒤 의식이 완료될 때까지 절대로 움직이면 안됩니다."},
[699] = {name = "생명력 흡수", additional_info = "마나 85 20 야드 사정거리\n집중 (5 초 주문 시전 시간)\n[q]대상으로부터 매초마다 17의 생명력을 흡수합니다. 5 sec 동안 지속됩니다."},
[700] = {name = "수면", additional_info = "마나 60 30 야드 사정거리\n1.5 초 주문 시전 시간\n[q]적을 최대 20 sec 동안 잠재웁니다. 대상이 피해를 입으면 깨어납니다. 한 번에 하나의 대상만 잠재울 수 있습니다."},
[701] = {name = "불화살", additional_info = "마나 10 30 야드 사정거리\n3 초 주문 시전 시간\n[q]적을 강타하여 19의 화염 피해를 입힙니다."},
[702] = {name = "무력화 저주", additional_info = "마나 20 30 야드 사정거리\n즉시\n[q]2 min 동안 대상의 공격력을 3만큼 감소시킵니다. 흑마법사마다 한 대상에 동시에 하나의 저주만 걸 수 있습니다."},
[703] = {name = "목조르기", additional_info = "기력 50 근접 사정거리\n즉시\n은신 필요\n[q]적의 목을 졸라 18 sec에 걸쳐 총 144의 피해를 입힙니다. 총 피해는 전투력에 따라 증가합니다. 적의 배후에서 은신 상태로 사용해야 합니다. 1의 연계 포인트가 주어집니다."},
[704] = {name = "무모함의 저주", additional_info = "마나 35 30 야드 사정거리\n즉시\n[q]무모함의 저주를 걸어 2 min 동안 근접 전투력을 20만큼 증가시키고 방어도를 140만큼 감소시킵니다. 이 마법이 지속되는 한 대상은 도망치지 않으며 겁이나 공포 효과를 무시합니다. 흑마법사마다 한 대상에 하나의 저주만 걸 수 있습니다."},
[705] = {name = "어둠의 화살", additional_info = "마나 70 30 야드 사정거리\n2.8 초 주문 시전 시간\n[q]적에게 어둠의 화살을 발사하여 52 to 61의 암흑 피해를 입힙니다."},
[706] = {name = "악마의 갑옷", additional_info = "마나 275\n즉시\n[q]방어도가 210만큼, 암흑 저항력이 3만큼 증가하고 5초마다 7의 생명력이 회복됩니다. 30 min 동안 지속됩니다."},
[707] = {name = "제물", additional_info = "마나 45 30 야드 사정거리\n2 초 주문 시전 시간\n[q]적을 불태워 [ 24 * ( ( ( 1 ) ) ) ]의 화염 피해를 입히고 추가로 15 sec에 걸쳐 총 40의 화염 피해를 입힙니다."},
[709] = {name = "생명력 흡수", additional_info = "마나 135 20 야드 사정거리\n집중 (5 초 주문 시전 시간)\n[q]대상으로부터 매초마다 29의 생명력을 흡수합니다. 5 sec 동안 지속됩니다."},
[710] = {name = "추방", additional_info = "마나 100 30 야드 사정거리\n1.5 초 주문 시전 시간\n[q]적을 차원의 저편으로 추방하여 어떤 행동도 하지 못하게 만듭니다. 최대 20 sec 동안 이 대상에겐 어떤 피해도 입히지 못합니다. 동시에 한 대상만 추방할 수 있습니다. 악마와 정령에게만 사용할 수 있습니다."},
