[759] = {name = "마나 마노 창조", additional_info = "마나 530\n3 초 주문 시전 시간\n[q]마나 마노를 창조합니다. 사용하면 즉시 375 to 425의 마나를 회복시켜줍니다.\n\n 창조된 물건은 접속 종료 후 15분이 지나면 사라집니다."},
