[769] = {name = "휘둘러치기", additional_info = "분노 20 근접 사정거리\n즉시 시전\n곰 변신, 광포한 곰 변신 필요\n[q]주위 적 3명을 휘둘러 공격하여 36의 피해를 입힙니다."},
[770] = {name = "요정의 불꽃", additional_info = "마나 55 30 야드 사정거리\n즉시\n[q]40 sec 동안 대상의 방어도를 175만큼 감소시킵니다. 효과가 지속되는 동안은 은신이나 투명화가 불가능합니다."},
[772] = {name = "분쇄", additional_info = "분노 10 근접 사정거리\n즉시 시전\n근접 무기 필요\n전투 태세, 방어 태세 필요\n[q]적에게 깊은 상처를 입혀 출혈을 일으킵니다. 9 sec에 걸쳐 총 15의 피해를 입힙니다."},
[774] = {name = "회복", additional_info = "마나 25 40 야드 사정거리\n즉시\n[q]12 sec에 걸쳐 32의 생명력을 회복시킵니다."},
[775] = {name = "나무 변신", additional_info = "20% (기본 마나 중)\n즉시 5 분 재사용 대기시간\n[q]8 sec 동안 나무 모습으로 변신합니다. 해로운 물리 효과가 사라지고 모든 물리 공격에 면역이 됩니다. 이 동안은 변이 효과에 영향을 받지 않습니다.\n\n 변신을 하게 되면 이동 불가나 덫, 얼어붙음 효과에서 벗어날 수 있습니다."},
[776] = {name = "마법 해제", additional_info = "마나 24 30 야드 사정거리\n즉시 1 초 재사용 대기시간\n[q]아군 대상의 모든 마법을 해제하며 5 sec 동안 어떤 마법도 걸 수 없도록 만듭니다."},
[778] = {name = "요정의 불꽃", additional_info = "마나 75 30 야드 사정거리\n즉시\n[q]40 sec 동안 대상의 방어도를 285만큼 감소시킵니다. 효과가 지속되는 동안은 은신이나 투명화가 불가능합니다."},
