[1463] = {name = "마나 보호막", additional_info = "마나 40\n즉시\n[q]마나를 소비하여 120의 물리 피해를 흡수합니다. 흡수된 피해당 2의 마나를 소비합니다. 1 min 동안 지속됩니다."},
