[1490] = {name = "원소의 저주", additional_info = "마나 100 30 야드 사정거리\n즉시\n[q]저주를 걸어 5 min 동안 대상의 화염과 냉기 마법에 대한 저항력을 45만큼 감소시키고 받는 화염과 냉기 피해를 6%만큼 증가시킵니다. 흑마법사마다 한 대상에 동시에 하나의 저주만 걸 수 있습니다."},
[1494] = {name = "야수 추적", additional_info = "즉시\n[q]주변에 있는 모든 야수의 위치를 미니맵에 표시합니다. 찾기는 동시에 한 종류만 사용할 수 있습니다."},
[1495] = {name = "살쾡이의 이빨", additional_info = "마나 30 근접 사정거리\n즉시 5 초 재사용 대기시간\n[q]적의 공격에 반격하여 25의 피해를 입힙니다. 적의 공격을 회피한 후에만 사용할 수 있습니다."},
[1499] = {name = "얼음의 덫", additional_info = "마나 50\n즉시 15 초 재사용 대기시간\n[q]덫을 설치합니다. 적이 다가오면 얼려서 최대 10 sec 동안 모든 행동을 불가능하도록 만듭니다. 덫에 걸린 적이 피해를 입게 되면 효과가 풀리게 됩니다. 덫은 1 min 동안 지속됩니다. 덫은 전투 중이 아닐 때만 설치할 수 있으며 동시에 한 개만 설치할 수 있습니다."},
[1509] = {name = "GM Only OFF", additional_info = nil},
[1510] = {name = "연발 사격", additional_info = "마나 350 8 - 35 야드 사정거리\n집중 (6 초 주문 시전 시간) 1 분 재사용 대기시간\n원거리 무기 필요\n[q]8미터 반경의 지역에 연발 사격을 가하여 대상 지역 내의 적에게 6 sec에 걸쳐 매초동안 50의 비전 피해를 입힙니다."},
[1513] = {name = "야수 겁주기", additional_info = "마나 35 10 야드 사정거리\n1.5 초 주문 시전 시간 30 초 재사용 대기시간\n[q]야수를 겁줘서 최대 10 sec 동안 달아나도록 만듭니다. 야수가 피해를 입으면 효과가 해제됩니다. 동시에 한 야수에게만 공포를 사용할 수 있습니다."},
[1515] = {name = "야수 길들이기", additional_info = "60% (기본 마나 중) 30 야드 사정거리\n집중 (20 초 주문 시전 시간)\n[q]야수를 길들여 친구로 만듭니다. 야수를 길들이는 데 집중하는 20 sec 동안은 방어도가 100%만큼 감소합니다. 만약 이 동안 어떤 이유로든 야수의 주의가 딴데로 돌아가게 된다면 길들이는 것은 실패하게 됩니다. 길들이는 데 성공하면 만족도와 충성도가 매우 낮습니다. 즉시 먹을 것을 줘서 만족도를 높이도록 하십시오."},
