[2641] = {name = "야수 소환해제", additional_info = "10 야드 사정거리\n5 초 주문 시전 시간\n[q]야수의 소환을 해제합니다. 소환 해제된 야수는 충성도가 50만큼 감소합니다."},
[2643] = {name = "일제 사격", additional_info = "마나 100 8 - 35 야드 사정거리\n즉시 10 초 재사용 대기시간\n원거리 무기 필요\n[q]여러 발의 탄환을 동시에 쏴서 3개의 대상을 적중시킵니다."},
[2645] = {name = "늑대 정령", additional_info = "마나 100\n3 초 주문 시전 시간\n[q]주술사의 모습을 늑대 정령으로 바꿉니다. 이동 속도가 40%만큼 증가합니다. 야외에서만 사용할 수 있습니다."},
[2647] = {name = "주문 2647", additional_info = "마나 68\n즉시"},
[2649] = {name = "포효", additional_info = "집중 15 근접 사정거리\n즉시 시전 5 초 재사용 대기시간\n[q]대상을 도발하여 대상이 자신에게 공격을 집중할 확률을 증가시킵니다."},
[2651] = {name = "엘룬의 은총", additional_info = "마나 60\n즉시 5 분 재사용 대기시간\n[q]15 sec 동안 원거리 공격의 피해가 21만큼 감소하고 회피 확률이 10%만큼 증가합니다."},
[2652] = {name = "무력의 손길", additional_info = "마나 25\n즉시\n[q]다음 근접 공격을 받을 경우 공격자에게 8의 암흑 피해를 입히고 2 min 동안 공격자의 공격력을 2만큼 감소시킵니다."},
[2656] = {name = "제련술", additional_info = "즉시\n[q]광석을 녹여 주괴를 만듭니다. 광물을 제련하려면 가열로가 필요합니다."},
