[9269] = {name = "[q2]노움의 만능 원격조종기", additional_info = "12.5 초 주문 시전 시간\n도구:\n대장장이 망치 , 만능 스패너\n재료:\n청동 주괴 (6), 청동 회전 장치 , 기름 주머니 (2), 호안석 , 공작석\n[q2]노움의 만능 원격조종기\n착용 시 귀속\n장신구\n기계공학\n(125) 필요\n[q2]사용 효과: 짦은 시간 동안 기계류를 조정할 수 있습니다. 항상 동작하는 것은 아니며 기계의 오작동을 유발하여 멈추게 하거나 매우 화나게 만들 수 있습니다. 노움의 최첨단 기술력의 결정체. (3 분 재사용 대기시간)"},
