[9271] = {name = "액체역학 물고기 유인기", additional_info = "8 초 주문 시전 시간\n재료:\n청동 주괴 (2), 큰지렁이 , 굵은 화약\n(3)\n낚시\n(100) 필요\n[q2]사용 효과: 낚싯대에 사용하면 5분 동안 낚시 숙련도가 100만큼 증가합니다."},
