[17632] = {name = "[q4]현자의 돌", additional_info = "1 분 주문 시전 시간\n재료:\n불의 정수 (8), 대지의 정수 (8), 바람의 정수 (8), 물의 정수 (8), 생명의 정수 (8), 검은 황산 (2), 검은 연꽃 (4)\n[q4]현자의 돌\n획득 시 귀속\n고유 아이템장신구\n정신력 +8\n연금술\n(300) 필요\n[q2]착용 효과: 착용자의 치유 및 마나 물약 복용 효과가 33%만큼 증가합니다."},
