[20162] = {name = "성전사의 문장", additional_info = "마나 40\n즉시\n[q]30 sec 동안 성기사를 헌신의 기운으로 감싸 근접 전투력이 60만큼, 근접 공격 속도가 40%만큼 증가합니다. 하지만 각 공격의 피해는 약간 저하됩니다. 성기사마다 하나의 문장만 효력을 발휘합니다.\n\n 문장의 에너지를 적에게 폭발시키면 10 sec 동안 적이 입는 신성 피해가 30까지 증가합니다. 매번 공격 시 주문의 지속시간이 초기화됩니다. 성기사마다 하나의 심판만 효력을 발휘합니다."},
[20164] = {name = "심판의 문장", additional_info = "13% (기본 마나 중)\n즉시\n[q]30 sec 동안 성기사를 심판의 기운으로 감싸 매 근접 공격 시 일정 확률로 2 sec 동안 적을 기절시킵니다. 성기사마다 하나의 문장만 효력을 발휘합니다.\n\n 문장의 에너지를 폭발시키면 10 sec 동안 해당 적에 심판을 내립니다. 심판이 내려진 적은 도망가지 못합니다. 매번 공격 시 주문의 지속시간이 초기화됩니다. 성기사마다 하나의 심판만 효력을 발휘합니다."},
[20165] = {name = "빛의 문장", additional_info = "마나 110\n즉시\n[q]30 sec 동안 성기사를 천상의 빛으로 감싸 매 근접 공격 시 일정 확률로 성기사의 생명력을 39만큼 회복시킵니다. 성기사마다 하나의 문장만 효력을 발휘합니다.\n\n 문장의 에너지를 폭발시키면 10 sec 동안 해당 적에 심판을 내립니다. 심판이 내려진 적을 공격하는 이는 일정 확률로 25의 생명력이 회복됩니다. 매번 공격 시 주문의 지속시간이 초기화됩니다. 성기사마다 하나의 심판만 효력을 발휘합니다."},
[20166] = {name = "지혜의 문장", additional_info = "마나 135\n즉시\n[q]30 sec 동안 성기사를 천상의 빛으로 감싸 매 근접 공격 시 일정 확률로 성기사의 마나를 50만큼 회복시킵니다. 성기사마다 하나의 문장만 효력을 발휘합니다.\n\n 문장의 에너지를 폭발시키면 10 sec 동안 해당 적에 심판을 내립니다. 심판이 내려진 적을 공격하는 이는 일정 확률로 33의 마나가 회복됩니다. 매번 공격 시 주문의 지속시간이 초기화됩니다. 성기사마다 하나의 심판만 효력을 발휘합니다."},
