[25294] = {name = "일제 사격", additional_info = "마나 230 8 - 35 야드 사정거리\n즉시 10 초 재사용 대기시간\n원거리 무기 필요\n[q]여러 발의 탄환을 동시에 쏴서 3개의 대상을 적중시키고 150의 추가 피해를 입힙니다."},
[25295] = {name = "독사 쐐기", additional_info = "마나 250 8 - 35 야드 사정거리\n원거리 무기 필요\n[q]쐐기를 대상에게 발사하여 15 sec에 걸쳐 총 555의 자연 피해를 입힙니다. 사냥꾼마다 한 대상에 동시에 하나의 쐐기만 사용할 수 있습니다."},
[25296] = {name = "매의 상", additional_info = "마나 120\n즉시\n[q]사냥꾼이 매의 상을 취해 원거리 전투력을 120만큼 증가시킵니다. 한 번에 한 상만 취할 수 있습니다."},
[25297] = {name = "치유의 손길", additional_info = "마나 800 40 야드 사정거리\n3.5 초 주문 시전 시간\n[q]대상의 생명력을 2267 to 2677만큼 회복시킵니다."},
