[27585] = {name = "[q3]견고한 흑요석 허리띠", additional_info = "1 분 주문 시전 시간\n도구:\n대장장이 망치\n재료:\n작은 흑요석 파편 (14), 마력 깃든 토륨 주괴 (4), 대지의 정수 (2)\n[q3]견고한 흑요석 허리띠\n착용 시 귀속\n허리 판금\n방어도 397\n힘 +25\n내구도 45 / 45\n60\n[q2]착용 효과: 모든 저항력 +5"},
