[27587] = {name = "[q4]견고한 흑요석 흉갑", additional_info = "1 분 주문 시전 시간\n도구:\n대장장이 망치\n재료:\n큰 흑요석 파편 (18), 작은 흑요석 파편 (40), 마력 깃든 토륨 주괴 (12), 대지의 정수 (10), 거대한 에메랄드 (4)\n[q4]견고한 흑요석 흉갑\n착용 시 귀속\n가슴 판금\n방어도 814\n힘 +38\n체력 +16\n내구도 165 / 165\n60\n[q2]착용 효과: 주기적인 피해를 주지 않는 직접 공격 주문에 의해 가격 당했을 때 30%의 확률로 6 sec 동안 해당 주문 계열의 피해를 300 to 500만큼 흡수하는 마법 보호막이 생성됩니다. (효과 발동 확률: 30%, 10초 재사용 대기시간)"},
