[34074] = {name = "독사의 상", additional_info = "즉시 1 초 재사용 대기시간\n[q]사냥꾼이 독사의 상을 취합니다. 이 동안에는 매 원거리와 근접 공격 시 마나를 회복하지만 전체 공격력이 50%만큼 감소합니다. 추가로 사냥꾼은 매 3초마다 전체 마나의 4%에 해당하는 마나를 얻습니다. 원거리 무기의 공격 속도가 빠를 수록 회복되는 마나가 증가합니다. 원거리 무기가 필요합니다. 한 번에 한 상만 취할 수 있습니다."},
[34433] = {name = "어둠의 마귀", additional_info = "30 야드 사정거리\n즉시 5 분 재사용 대기시간\n[q]어둠의 마귀를 창조하여 대상을 공격하도록 합니다. 어둠의 마귀가 공격을 할 때마다 시전자는 0%의 마나를 회복합니다. 광역 공격으로 받는 피해가 감소합니다. 15 sec 동안 지속됩니다."},
