[398061] = {name = "재이동의 팔보호구", additional_info = "[q]현재 대상이 아닌 적 대상의 공격 또는 주문을 회피할 때마다 연계 점수 1점을 얻습니다.\n(1초 재사용 대기시간)"},
[398115] = {name = "면역 허리띠", additional_info = "즉시\n[q]1%의 피해를 받고 자신에게 걸린 질병 또는 독 효과를 제거합니다."},
[398117] = {name = "간식 주머니", additional_info = "20 야드 사정거리\n즉시\n[q]간식 가방을 열고 대상의 주머니에 욱여넣습니다. 야수가 대상에게 입히는 피해가 20만큼 증가합니다."},
