[398198] = {name = "도검의 폭풍", additional_info = "기력 20 100 야드 사정거리\n즉시\n[q]마무리 일격을 날립니다. 무기 막기 확률이 증가합니다. 연계 점수에 따라 지속시간이 증가하고 무기 막기 확률이 증가합니다.\n 연계 점수 1점: 10초, 12%의 무기 막기 확률\n 연계 점수 2점: 15초, 14%의 무기 막기 확률\n 연계 점수 3점: 20초, 16%의 무기 막기 확률\n 연계 점수 4점: 25초, 18%의 무기 막기 확률\n 연계 점수 5점: 30초, 20%의 무기 막기 확률"},
[398199] = {name = "오만의 튜닉", additional_info = nil},
[398538] = {name = "손목보호구 룬조각술 - 최하급 튕겨내기", additional_info = "5 초 주문 시전 시간\n손목보호구 필요\n도구:\n룬문자 구리마법막대\n재료:\n하급 마법의 정수 , 이상한 가루\n[q]손목보호구에 영구적으로 마법을 부여해 착용자의 방어 능력이 1만큼 증가합니다."},
