[399954] = {name = "가슴보호구 룬 능력", additional_info = "즉시\n[q]룬을 각인한 가슴보호구 칸 아이템을 장착하면 해당 칸의 능력이 활성화됩니다."},
[399956] = {name = "절단", additional_info = "기력 40 근접 사정거리\n즉시"},
[399960] = {name = "절단", additional_info = "근접 사정거리\n즉시\n[q]양쪽 손에 장착한 무기로 적을 즉시 공격하여 각 무기마다 무기 공격력의 100%에 [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)]의 추가 피해를 입힙니다. 독에 걸린 대상을 가격할 시 공격력이 20%만큼 증가합니다. 연계 점수 2점이 주어집니다."},
[399961] = {name = "절단", additional_info = "근접 사정거리\n즉시\n[q]양쪽 손에 장착한 무기로 적을 즉시 공격하여 각 무기마다 무기 공격력의 100%에 $[100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)]의 추가 피해를 입힙니다. 독에 걸린 대상을 가격할 시 공격력이 20%만큼 증가합니다. 연계 점수 2점이 주어집니다."},
[399962] = {name = "절단", additional_info = nil},
[399963] = {name = "독살", additional_info = "기력 35 근접 사정거리\n즉시\n근접 무기 필요\n[q]적에게 마무리 일격을 날립니다. 대상에 걸린 맹독에 따라 즉시 독 피해를 입힙니다. 독살 공격 후 75%의 확률로 연계 점수당 1초에 추가로 1초 동안 순간 효과 독에 감염시킵니다. 각 연계 점수당 하나의 맹독을 활성화합니다.\n 맹독 1회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 1 + Attack power * 0.09]의 피해\n 맹독 2회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 2 + Attack power * 0.18]의 피해\n 맹독 3회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 3 + Attack power * 0.27]의 피해\n 맹독 4회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 4 + Attack power * 0.36]의 피해\n 맹독 5회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 5 + Attack power * 0.45]의 피해"},
[399965] = {name = "맹독 조합", additional_info = "[q]독에 여러 강화 효과를 부여합니다.\n\n 대상에게 다른 독을 부여하면 추가로 맹독을 겁니다.\n\n 무기에 독을 바르지 않은 상태일 경우, 일정 확률로 순간 효과 독을 바른 것처럼 순간 효과 독을 발동시킵니다.\n\n 맹독과 순간 효과 독은 이제 전투력의 이로운 효과를 받아 공격력이 증가합니다."},
[399966] = {name = "다리보호구 룬 능력", additional_info = "즉시\n[q]룬을 각인한 다리보호구 칸 아이템을 장착하면 해당 칸의 능력이 활성화됩니다."},
[399967] = {name = "손보호구 룬 능력", additional_info = "즉시\n[q]룬을 각인한 손보호구 칸 아이템을 장착하면 해당 칸의 능력이 활성화됩니다."},
[399968] = {name = "독살", additional_info = "[q]독살 능력을 얻습니다.\n\n\n 적에게 마무리 일격을 날립니다. 대상에 걸린 맹독에 따라 즉시 독 피해를 입힙니다. 독살 공격 후 75%의 확률로 연계 점수당 1초에 추가로 1초 동안 순간 효과 독에 감염시킵니다. 각 연계 점수당 하나의 맹독을 활성화합니다.\n 맹독 1회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 1 + Attack power * 0.09]의 피해\n 맹독 2회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 2 + Attack power * 0.18]의 피해\n 맹독 3회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 3 + Attack power * 0.27]의 피해\n 맹독 4회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 4 + Attack power * 0.36]의 피해\n 맹독 5회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 5 + Attack power * 0.45]의 피해"},
[399969] = {name = "맹독 조합", additional_info = "[q]맹독 조합 능력을 얻습니다.\n\n\n독에 여러 강화 효과를 부여합니다.\n\n 대상에게 다른 독을 부여하면 추가로 맹독을 겁니다.\n\n 무기에 독을 바르지 않은 상태일 경우, 일정 확률로 순간 효과 독을 바른 것처럼 순간 효과 독을 발동시킵니다.\n\n 맹독과 순간 효과 독은 이제 전투력의 이로운 효과를 받아 공격력이 증가합니다."},
[399985] = {name = "그림자 일격", additional_info = "기력 20 25 야드 사정거리\n즉시\n근접 무기 필요\n은신 필요\n[q]대상의 배후로 순간이동한 후 대상에게 일격을 날려 무기 공격력의 150%에 해당하는 피해를 입힙니다. 은신 상태로 사용해야 합니다. 연계 점수 1점을 생성합니다."},
[399986] = {name = "표창 투척", additional_info = "기력 30 25 야드 사정거리\n즉시\n[q]적에게 표창을 던져 전투력의 15%에 해당하는 피해를 입히고, 주위 적 최대 4명을 추가로 가격합니다. 연계 점수 1점을 생성합니다."},
[400009] = {name = "미간 적중", additional_info = "기력 35 20 야드 사정거리\n20 초 재사용 대기시간\n원거리 무기 필요\n[q]적에게 원거리 마무리 일격을 날립니다. 연계 점수에 따라 피해를 입히며 전투력을 기반으로 증가합니다. 또한 대상을 기절시킵니다.\n\n 연계 점수 1점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))]의 피해, 1초 동안 기절\n 연계 점수 2점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)]의 피해, 2초 동안 기절\n 연계 점수 3점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)]의 피해, 3초 동안 기절\n 연계 점수 4점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)]의 피해, 4초 동안 기절\n 연계 점수 5점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)]의 피해, 5초 동안 기절\n\n 급소 가격과 재사용 대기시간을 공유합니다."},
[400012] = {name = "칼춤", additional_info = "기력 25 100 야드 사정거리\n즉시\n[q]마무리 일격을 날려 무기 막기 확률을 10%만큼 증가시킵니다. 연계 점수당 다음 시간 동안 지속됩니다.\n\n 연계 점수 1점: 14초\n 연계 점수 2점: 18초\n 연계 점수 3점: 22초\n 연계 점수 4점: 26초\n 연계 점수 5점: 30초"},
[400014] = {name = "얕은 상처일 뿐", additional_info = "[q]칼춤이 활성화된 동안 받는 물리 피해가 20%만큼 감소합니다. 추가로 근접 공격에 치명타로 적중당할 확률이 6%만큼 감소하고 모든 행동으로 생성되는 위협 수준이 크게 증가합니다. 교란 능력은 놀리기로 대체됩니다. 놀리기는 대상을 도발하여 자신을 공격하게 합니다.\n\n\n적을 도발하여 자신을 공격하도록 만듭니다. 이미 자신을 공격하고 있다면 아무런 효과를 발휘하지 못합니다."},
[400015] = {name = "충격 완화", additional_info = nil},
[400016] = {name = "충격 완화", additional_info = "[q]회피 또는 무기 막기를 할 때마다 생명력이 6%만큼 증가합니다. 최대 5번까지 중첩됩니다."},
[400024] = {name = "구사일생", additional_info = "즉시\n[q]자신을 죽음에 이르게 만드는 공격을 받았을 때 전체 생명력의 10%에 해당하는 생명력을 남기고 살아납니다. 또한 3 sec 동안 받는 모든 피해가 최대 90%만큼 감소합니다. 이 효과는 1분에 1번씩만 발동됩니다."},
[400029] = {name = "그림자 밟기", additional_info = "25 야드 사정거리\n즉시 30 초 재사용 대기시간\n[q]그림자 사이로 숨어들어 적의 배후에서 나타납니다. 3 sec 동안 이동 속도가 70%만큼 증가합니다."},
[400031] = {name = "그림자 일격", additional_info = "[q]그림자 일격 능력을 얻습니다.\n\n\n대상의 배후로 순간이동한 후 대상에게 일격을 날려 무기 공격력의 150%에 해당하는 피해를 입힙니다. 은신 상태로 사용해야 합니다. 연계 점수 1점을 생성합니다."},
[400032] = {name = "표창 투척", additional_info = "[q]표창 투척 능력을 얻습니다.\n\n\n적에게 표창을 던져 전투력의 15%에 해당하는 피해를 입히고, 주위 적 최대 4명을 추가로 가격합니다. 연계 점수 1점을 생성합니다."},
[400033] = {name = "미간 적중", additional_info = "[q]미간 적중 능력을 얻습니다.\n\n\n적에게 원거리 마무리 일격을 날립니다. 연계 점수에 따라 피해를 입히며 전투력을 기반으로 증가합니다. 또한 대상을 기절시킵니다.\n\n 연계 점수 1점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))]의 피해, 1초 동안 기절\n 연계 점수 2점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)]의 피해, 2초 동안 기절\n 연계 점수 3점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)]의 피해, 3초 동안 기절\n 연계 점수 4점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)]의 피해, 4초 동안 기절\n 연계 점수 5점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)]의 피해, 5초 동안 기절\n\n 급소 가격과 재사용 대기시간을 공유합니다."},
[400037] = {name = "그림자 밟기", additional_info = "[q]그림자 밟기 능력을 얻습니다.\n\n\n그림자 사이로 숨어들어 적의 배후에서 나타납니다. 3 sec 동안 이동 속도가 70%만큼 증가합니다."},
[400038] = {name = "칼춤", additional_info = "[q]칼춤 능력을 얻습니다.\n\n\n마무리 일격을 날려 무기 막기 확률을 10%만큼 증가시킵니다. 연계 점수당 다음 시간 동안 지속됩니다.\n\n 연계 점수 1점: 14초\n 연계 점수 2점: 18초\n 연계 점수 3점: 22초\n 연계 점수 4점: 26초\n 연계 점수 5점: 30초"},
[400039] = {name = "얕은 상처일 뿐", additional_info = "[q]얕은 상처일 뿐 능력을 얻습니다.\n\n\n칼춤이 활성화된 동안 받는 물리 피해가 20%만큼 감소합니다. 추가로 근접 공격에 치명타로 적중당할 확률이 6%만큼 감소하고 모든 행동으로 생성되는 위협 수준이 크게 증가합니다. 교란 능력은 놀리기로 대체됩니다. 놀리기는 대상을 도발하여 자신을 공격하게 합니다.\n\n\n적을 도발하여 자신을 공격하도록 만듭니다. 이미 자신을 공격하고 있다면 아무런 효과를 발휘하지 못합니다."},
[400040] = {name = "충격 완화", additional_info = "[q]충격 완화 능력을 얻습니다.\n\n\n회피 또는 무기 막기를 할 때마다 생명력이 6%만큼 증가합니다. 최대 5번까지 중첩됩니다."},
[400080] = {name = "가슴보호구 각인술 - 맹독 조합", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 맹독 조합 룬을 새깁니다.\n\n\n독에 여러 강화 효과를 부여합니다.\n\n 대상에게 다른 독을 부여하면 추가로 맹독을 겁니다.\n\n 무기에 독을 바르지 않은 상태일 경우, 일정 확률로 순간 효과 독을 바른 것처럼 순간 효과 독을 발동시킵니다.\n\n 맹독과 순간 효과 독은 이제 전투력의 이로운 효과를 받아 공격력이 증가합니다."},
[400081] = {name = "바지 각인술 - 미간 적중", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 미간 적중 룬을 새깁니다.\n\n\n적에게 원거리 마무리 일격을 날립니다. 연계 점수에 따라 피해를 입히며 전투력을 기반으로 증가합니다. 또한 대상을 기절시킵니다.\n\n 연계 점수 1점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))]의 피해, 1초 동안 기절\n 연계 점수 2점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)]의 피해, 2초 동안 기절\n 연계 점수 3점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)]의 피해, 3초 동안 기절\n 연계 점수 4점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)]의 피해, 4초 동안 기절\n 연계 점수 5점: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)]에서 [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)]의 피해, 5초 동안 기절\n\n 급소 가격과 재사용 대기시간을 공유합니다."},
[400082] = {name = "가슴보호구 각인술 - 얕은 상처일 뿐", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 얕은 상처일 뿐 룬을 새깁니다.\n\n\n칼춤이 활성화된 동안 받는 물리 피해가 20%만큼 감소합니다. 추가로 근접 공격에 치명타로 적중당할 확률이 6%만큼 감소하고 모든 행동으로 생성되는 위협 수준이 크게 증가합니다. 교란 능력은 놀리기로 대체됩니다. 놀리기는 대상을 도발하여 자신을 공격하게 합니다.\n\n\n적을 도발하여 자신을 공격하도록 만듭니다. 이미 자신을 공격하고 있다면 아무런 효과를 발휘하지 못합니다."},
[400093] = {name = "장화 각인술 - 충격 완화", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 충격 완화 룬을 새깁니다.\n\n\n회피 또는 무기 막기를 할 때마다 생명력이 6%만큼 증가합니다. 최대 5번까지 중첩됩니다."},
[400094] = {name = "장갑 각인술 - 절단", additional_info = "3 초 주문 시전 시간\n장갑 필요"},
[400095] = {name = "가슴보호구 각인술 - 빠른 사격", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요"},
[400096] = {name = "허리띠 각인술 - 표창 투척", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 표창 투척 룬을 새깁니다.\n\n\n적에게 표창을 던져 전투력의 15%에 해당하는 피해를 입히고, 주위 적 최대 4명을 추가로 가격합니다. 연계 점수 1점을 생성합니다."},
[400099] = {name = "바지 각인술 - 칼춤", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 칼춤 룬을 새깁니다.\n\n\n마무리 일격을 날려 무기 막기 확률을 10%만큼 증가시킵니다. 연계 점수당 다음 시간 동안 지속됩니다.\n\n 연계 점수 1점: 14초\n 연계 점수 2점: 18초\n 연계 점수 3점: 22초\n 연계 점수 4점: 26초\n 연계 점수 5점: 30초"},
[400101] = {name = "허리띠 각인술 - 그림자 밟기", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 그림자 밟기 룬을 새깁니다.\n\n\n그림자 사이로 숨어들어 적의 배후에서 나타납니다. 3 sec 동안 이동 속도가 70%만큼 증가합니다."},
[400102] = {name = "바지 각인술 - 독살", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 독살 룬을 새깁니다.\n\n\n 적에게 마무리 일격을 날립니다. 대상에 걸린 맹독에 따라 즉시 독 피해를 입힙니다. 독살 공격 후 75%의 확률로 연계 점수당 1초에 추가로 1초 동안 순간 효과 독에 감염시킵니다. 각 연계 점수당 하나의 맹독을 활성화합니다.\n 맹독 1회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 1 + Attack power * 0.09]의 피해\n 맹독 2회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 2 + Attack power * 0.18]의 피해\n 맹독 3회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 3 + Attack power * 0.27]의 피해\n 맹독 4회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 4 + Attack power * 0.36]의 피해\n 맹독 5회: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 5 + Attack power * 0.45]의 피해"},
[400104] = {name = "바지 각인술 - 그림자 밟기", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 그림자 밟기 룬을 새깁니다.\n\n\n그림자 사이로 숨어들어 적의 배후에서 나타납니다. 3 sec 동안 이동 속도가 70%만큼 증가합니다."},
[400105] = {name = "장갑 각인술 - 그림자 일격", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 그림자 일격 룬을 새깁니다.\n\n\n대상의 배후로 순간이동한 후 대상에게 일격을 날려 무기 공격력의 150%에 해당하는 피해를 입힙니다. 은신 상태로 사용해야 합니다. 연계 점수 1점을 생성합니다."},
[400573] = {name = "비전 작렬", additional_info = "즉시 3 분 재사용 대기시간\n[q]적을 강력한 에너지로 강타하여 비전 피해를 입힙니다. 이 주문을 시전할 때마다 다른 모든 비전 주문의 공격력과 치유량이 15%만큼, 비전 작렬 주문의 마나 소비량이 175%만큼 증가합니다. 최대 4번까지 적용되며 6 sec 동안 지속됩니다."},
[400574] = {name = "비전 작렬", additional_info = "7% (기본 마나 중) 30 야드 사정거리\n2.5 초 주문 시전 시간\n[q]적을 강력한 에너지로 강타하여 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 453 / 100]에서 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 527 / 100]의 비전 피해를 입힙니다. 이 주문을 시전할 때마다 다른 모든 비전 주문의 공격력과 치유량이 15%만큼, 비전 작렬 주문의 마나 소비량이 175%만큼 증가합니다. 최대 4번까지 적용되며 6 sec 동안 혹은 비전 작렬을 제외한 다른 비전 공격 또는 치유 주문 시전 시까지 지속됩니다."},
[400586] = {name = "비전 작렬", additional_info = "즉시 3 분 재사용 대기시간\n[q]적을 강력한 에너지로 강타하여 비전 피해를 입힙니다. 이 주문을 시전할 때마다 다른 모든 비전 주문의 공격력이 15%만큼, 비전 작렬 주문의 마나 소비량이 175%만큼 증가합니다. 최대 4번까지 적용되며 6 sec 동안 지속됩니다."},
[400588] = {name = "화살 탄막", additional_info = "[q]비전 작렬 시전 시 40%의 확률로, 비전 탄막, 화염구, 얼음 화살, 얼음불꽃 화살, 비전냉기 화살 시전 시 20%의 확률로 다음 신비한 화살 주문의 정신 집중 시간이 50%만큼 감소하고 마나 소비량이 100%만큼 감소하며 매 0.5초마다 화살을 발사합니다.\n(효과 발동 확률: 40%)"},
[400589] = {name = "화살 탄막", additional_info = "즉시\n[q]비전 작렬, 비전 탄막, 화염구, 얼음 화살, 얼음불꽃 화살 시전 시 일정 확률로 다음 신비한 화살 주문의 정신 집중 시간이 50%만큼 감소하고 마나 소비량이 100%만큼 감소하며 매 0.5초마다 화살을 발사합니다."},
[400613] = {name = "살아있는 폭탄", additional_info = "22% (기본 마나 중) 35 야드 사정거리\n즉시\n[q]대상은 살아있는 폭탄이 되어 12 sec에 걸쳐 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4]의 화염 피해를 입습니다. 12 sec 후, 혹은 주문이 무효화되면 대상은 폭발하여 10미터 반경 내에 있는 모든 적에게 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100]의 화염 피해를 입힙니다."},
[400614] = {name = "살아있는 폭탄", additional_info = "100 야드 사정거리\n즉시\n[q]대상은 살아있는 폭탄이 되어 until cancelled에 걸쳐 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4]의 화염 피해를 입습니다. until cancelled 후, 혹은 주문이 무효화되면 대상은 폭발하여 10미터 반경 내에 있는 모든 적에게 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100]의 화염 피해를 입힙니다."},
[400616] = {name = "화염 작렬", additional_info = "마나 115 20 야드 사정거리\n즉시 8 초 재사용 대기시간\n[q]적을 강타하여 110 to 134의 화염 피해를 입힙니다."},
[400618] = {name = "화염 작렬", additional_info = "마나 40 20 야드 사정거리\n즉시 8 초 재사용 대기시간\n[q]적을 강타하여 27 to 35의 화염 피해를 입힙니다."},
[400619] = {name = "화염 작렬", additional_info = "마나 75 20 야드 사정거리\n즉시 8 초 재사용 대기시간\n[q]적을 강타하여 62 to 76의 화염 피해를 입힙니다."},
[400620] = {name = "화염 작렬", additional_info = "마나 165 20 야드 사정거리\n즉시 8 초 재사용 대기시간\n[q]적을 강타하여 177 to 211의 화염 피해를 입힙니다."},
[400621] = {name = "화염 작렬", additional_info = "마나 220 20 야드 사정거리\n즉시 8 초 재사용 대기시간\n[q]적을 강타하여 253 to 301의 화염 피해를 입힙니다."},
[400622] = {name = "화염 작렬", additional_info = "마나 280 20 야드 사정거리\n즉시 8 초 재사용 대기시간\n[q]적을 강타하여 345 to 407의 화염 피해를 입힙니다."},
[400623] = {name = "화염 작렬", additional_info = "마나 340 20 야드 사정거리\n즉시 8 초 재사용 대기시간\n[q]적을 강타하여 446 to 524의 화염 피해를 입힙니다."},
[400624] = {name = "몰아치는 열기", additional_info = "[q]주기적인 피해를 제외하고 화염구, 화염 작렬, 불태우기 또는 살아있는 폭탄 주문이 2회 연속해서 극대화 효과를 발휘하면 10 sec 내에 시전하는 다음 불덩이 작열 주문은 즉시 시전됩니다."},
[400625] = {name = "몰아치는 열기", additional_info = "즉시\n[q]화염구, 화염 작렬, 불태우기, 살아있는 폭탄, 비전화염 또는 얼음불꽃 화살 주문이 2회 연속해서 극대화 효과를 발휘하면 일정 확률로 10 sec 내에 시전하는 다음 불덩이 작열 주문은 즉시 시전됩니다."},
