[401744] = {name = "살아있는 불꽃", additional_info = "[q]살아있는 불꽃 능력을 얻습니다.\n\n\n대상 방향으로 이동하는 비전화염 불꽃을 소환합니다. 불꽃은 비전화염의 흔적을 남깁니다. 흔적은 주위의 적에게 1초마다 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 100 / 100]의 비전화염 피해를 입힙니다. 10 sec 동안 지속됩니다."},
[401749] = {name = "허리띠 각인술 - 몰아치는 열기", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 몰아치는 열기 룬을 새깁니다.\n\n\n 주기적인 피해를 제외하고 화염구, 화염 작렬, 불태우기 또는 살아있는 폭탄 주문이 2회 연속해서 극대화 효과를 발휘하면 10 sec 내에 시전하는 다음 불덩이 작열 주문은 즉시 시전됩니다."},
[401752] = {name = "장화 각인술 - 두뇌 빙결", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 두뇌 빙결 룬을 새깁니다.\n\n\n 빙결 효과가 있는 냉기 주문 시전 시 15%의 확률로 다음 화염구와 비전냉기 화살, 얼음불꽃 화살 주문이 마나를 소비하지 않고 즉시 시전됩니다."},
[401754] = {name = "투구 각인술 - 고급 수호물", additional_info = "3 초 주문 시전 시간\n투구 필요\n[q]투구에 고급 수호물 룬을 새깁니다.\n\n\n마나 보호막, 냉기계 수호, 화염계 수호의 효과가 100%만큼 증가합니다. 또한 마나 보호막의 흡수된 피해당 마나 소모량이 50%만큼 감소합니다."},
[401757] = {name = "장갑 각인술 - 비전 작렬", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 비전 작렬 룬을 새깁니다.\n\n\n적을 강력한 에너지로 강타하여 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 453 / 100]에서 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 527 / 100]의 비전 피해를 입힙니다. 이 주문을 시전할 때마다 다른 모든 비전 주문의 공격력과 치유량이 15%만큼, 비전 작렬 주문의 마나 소비량이 175%만큼 증가합니다. 최대 4번까지 적용되며 6 sec 동안 혹은 비전 작렬을 제외한 다른 비전 공격 또는 치유 주문 시전 시까지 지속됩니다."},
[401759] = {name = "가슴보호구 각인술 - 완전 연소", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구에 완전 연소 룬을 새깁니다.\n\n\n모든 주문의 주문 극대화율이 15%만큼 증가하지만 비주기적인 주문이 극대화 효과를 발휘할 때 기본 마나의 1%를 추가로 소모합니다."},
[401760] = {name = "장갑 각인술 - 얼음창", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 얼음창 룬을 새깁니다.\n\n\n적에게 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 55 / 100]에서 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 65 / 100]의 냉기 피해를 입힙니다. 얼어붙은 대상에게는 3배의 피해를 입힙니다."},
[401761] = {name = "장갑 각인술 - 시간 되돌리기", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 시간 되돌리기 룬을 새깁니다.\n\n\n 시간의 봉화가 부여된 현재 대상이 즉시 지난 5초 동안 받는 모든 피해를 흡수합니다. 5초 전에 시간의 봉화가 부여되어 있지 않았던 대상에게는 효과를 발휘하지 않습니다."},
[401762] = {name = "허리띠 각인술 - 얼음불꽃 화살", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 얼음불꽃 화살 룬을 새깁니다.\n\n\n적에게 얼음불꽃 화살을 발사하여 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 387 / 100 * ( 1 ) ]에서 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 451 / 100 * ( 1 ) ]의 냉기화염 피해를 입히고 이동 속도를 40%만큼 감소시킨 후 9 sec에 걸쳐 추가로 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 12 / 100 * 3 * ( 1 ) ]의 냉기화염 피해를 입힙니다. 이 주문은 대상의 냉기 및 화염 저항력 중 낮은 수치를 상대로 적중하며, 냉기 및 화염 피해로 간주됩니다."},
[401763] = {name = "허리띠 각인술 - 화살 탄막", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 화살 탄막 룬을 새깁니다.\n\n\n비전 작렬 시전 시 40%의 확률로, 비전 탄막, 화염구, 얼음 화살, 얼음불꽃 화살, 비전냉기 화살 시전 시 20%의 확률로 다음 신비한 화살 주문의 정신 집중 시간이 50%만큼 감소하고 마나 소비량이 100%만큼 감소하며 매 0.5초마다 화살을 발사합니다."},
[401765] = {name = "가슴보호구 각인술 - 서리의 손가락", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 서리의 손가락 룬을 새깁니다.\n\n\n빙결 효과를 일으키면 15%의 확률로 서리의 손가락 효과를 받아, 자신이 시전하는 다음 2회의 주문은 얼어붙은 대상을 공격하는 효과를 내도록 합니다. 15 sec 동안 지속됩니다."},
[401767] = {name = "가슴보호구 각인술 - 재생", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 재생 룬을 새깁니다.\n\n\n대상을 3 sec에 걸쳐 [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3]만큼 치유하고 30초 동안 시간의 봉화를 부여합니다.\n\n 시간의 봉화\n\n대상의 시공간 위치를 기록합니다. 시전자가 입히는 모든 비전 피해의 80%가 시간의 치유로 전환되어 현재 시간의 봉화가 부여된 각 대상을 치유합니다. 대상이 자신일 경우 치유량이 50%만큼 감소합니다. 또한 여러 대상을 공격하는 비전 주문으로 피해를 입힐 경우에는 치유량이 80%만큼 감소합니다."},
[401768] = {name = "바지 각인술 - 살아있는 불꽃", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 살아있는 불꽃 룬을 새깁니다.\n\n\n대상 방향으로 이동하는 비전화염 불꽃을 소환합니다. 불꽃은 비전화염의 흔적을 남깁니다. 흔적은 주위의 적에게 1초마다 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 100 / 100]의 비전화염 피해를 입힙니다. 10 sec 동안 지속됩니다."},
