[402789] = {name = "공허의 눈", additional_info = "30 야드 사정거리\n즉시 3 분 재사용 대기시간\n[q]공허의 눈을 불러내 30 sec 동안 전투를 돕게 합니다. 눈은 대상에게 여러 저주를 겁니다."},
[402790] = {name = "어둠의 화살", additional_info = "5% (기본 마나 중) 40 야드 사정거리\n3 초 주문 시전 시간\n[q]적에게 암흑 화살을 발사하여 암흑 피해를 입힙니다."},
[402791] = {name = "어둠의 저주", additional_info = "20% (기본 마나 중) 30 야드 사정거리\n즉시 3 분 재사용 대기시간\n[q]저주를 걸어 3 min 동안 대상의 암흑과 비전 마법에 대한 저항력을 75만큼 감소시키고 받는 암흑과 비전 피해를 10%만큼 증가시킵니다. 흑마법사마다 한 대상에 동시에 하나의 저주만 걸 수 있습니다."},
[402792] = {name = "원소의 저주", additional_info = "20% (기본 마나 중) 30 야드 사정거리\n즉시 3 분 재사용 대기시간\n[q]저주를 걸어 3 min 동안 대상의 화염과 냉기 마법에 대한 저항력을 75만큼 감소시키고 받는 화염과 냉기 피해를 10%만큼 증가시킵니다. 흑마법사마다 한 대상에 동시에 하나의 저주만 걸 수 있습니다."},
[402794] = {name = "언어의 저주", additional_info = "20% (기본 마나 중) 30 야드 사정거리\n즉시 3 분 재사용 대기시간\n[q]대상을 강제로 악마어로 말하도록 하여 주문의 시전 시간을 60%만큼 지연시킵니다. 흑마법사마다 한 대상에 동시에 하나의 저주만 걸 수 있습니다. 3 min 동안 지속됩니다."},
[402799] = {name = "호문쿨루스", additional_info = "40 야드 사정거리\n즉시 2 분 재사용 대기시간\n[q]영혼의 일부를 쪼개어 자신의 작은 복제 3개를 살아 움직이게 하여, 현재 대상을 철퇴, 검, 도끼로 공격하게 합니다. 각 공격은 적중당한 대상의 공격 속도, 전투력, 방어도를 감소시킵니다."},
[402801] = {name = "호문쿨루스", additional_info = "40 야드 사정거리\n즉시 2 분 재사용 대기시간\n[q]해골 5마리를 되살려 현재 대상을 철퇴, 검 도끼로 공격하게 합니다. 각 공격은 대상의 공격 속도, 전투력, 방어도를 감소시킵니다."},
[402802] = {name = "호문쿨루스", additional_info = "40 야드 사정거리\n즉시 2 분 재사용 대기시간\n[q]해골 5마리를 되살려 현재 대상을 철퇴, 검 도끼로 공격하게 합니다. 각 공격은 대상의 공격 속도, 전투력, 방어도를 감소시킵니다."},
[402808] = {name = "신경 마비", additional_info = "근접 사정거리\n즉시 6 초 재사용 대기시간\n[q]15 sec 동안 적의 공격 간격을 10%만큼 늘립니다."},
[402811] = {name = "사기 저하", additional_info = "근접 사정거리\n즉시 6 초 재사용 대기시간\n[q]대상의 전투력을 190만큼 감소시킵니다. 15 sec 동안 지속됩니다."},
[402818] = {name = "열화", additional_info = "근접 사정거리\n즉시 6 초 재사용 대기시간\n[q]15 sec 동안 적의 방어도를 2250만큼 감소시킵니다."},
[402832] = {name = "회복의 기원", additional_info = "[q]회복의 기원 능력을 얻습니다.\n\n\n대상에 마력을 불어 넣어 다음에 피해를 입거나 치유 효과를 받을 시 [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100]의 생명력을 회복하도록 합니다. 생명력이 회복될 때 20미터 반경 내의 파티원 혹은 공격대원에게로 회복의 기원이 전달됩니다. 최대 5번까지 이동하며 매 이동 시마다 효과는 30 sec 동안 지속됩니다. 이 주문은 동시에 한 대상에게만 걸 수 있습니다."},
[402833] = {name = "어둠의 권능: 죽음", additional_info = "[q]어둠의 권능: 죽음 능력을 얻습니다.\n\n\n어둠의 힘으로 대상에게 [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 320 / 100]에서 [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 372 / 100]의 암흑 피해를 입힙니다. 만약 대상이 어둠의 권능: 죽음에 의해 죽지 않았다면 시전자는 대상에게 입힌 피해의 50%에 해당하는 피해를 입습니다."},
[402836] = {name = "호문쿨루스", additional_info = "[q]호문쿨루스 능력을 얻습니다.\n\n\n영혼의 일부를 쪼개어 자신의 작은 복제 3개를 살아 움직이게 하여, 현재 대상을 철퇴, 검, 도끼로 공격하게 합니다. 각 공격은 적중당한 대상의 공격 속도, 전투력, 방어도를 감소시킵니다."},
[402838] = {name = "나누는 고통", additional_info = "[q]나누는 고통 능력을 얻습니다.\n\n\n어둠의 권능: 고통이 주위 15미터 내에 있는 최대 2명의 추가 대상에게 영향을 줍니다."},
[402839] = {name = "고통 억제", additional_info = "[q]고통 억제 능력을 얻습니다.\n\n\n 아군 대상이 받는 모든 피해를 즉시 40%만큼 감소시키고 8 sec 동안 무효화에 대한 저항력을 65%만큼 증가시킵니다."},
[402842] = {name = "치유의 마법진", additional_info = "[q]치유의 마법진 능력을 얻습니다.\n\n\n대상 플레이어의 40미터 내에 있는 모든 파티원을 [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 130 / 100]에서 [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 144 / 100]만큼 치유합니다."},
[402843] = {name = "어둠의 마귀", additional_info = "[q]어둠의 마귀 능력을 얻습니다.\n\n\n어둠의 마귀를 창조하여 대상을 공격하도록 합니다. 시전자는 어둠의 마귀가 공격할 때마다 5%의 마나를 회복합니다. 15 sec 동안 지속됩니다."},
[402844] = {name = "회개", additional_info = "[q]회개 능력을 얻습니다.\n\n\n 신성한 빛의 화살로 적에게 [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 128 / 100]의 신성 피해를 입히거나 2 sec 동안 즉시 그리고 매 1초마다 아군의 생명력을 [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 85 / 100]만큼 회복시킵니다."},
[402846] = {name = "공허의 눈", additional_info = "[q]공허의 눈 능력을 얻습니다.\n\n\n공허의 눈을 불러내 30 sec 동안 전투를 돕게 합니다. 눈은 대상에게 여러 저주를 겁니다."},
