[402862] = {name = "장갑 각인술 - 회개", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 회개 룬을 새깁니다.\n\n\n 신성한 빛의 화살로 적에게 [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 128 / 100]의 신성 피해를 입히거나 2 sec 동안 즉시 그리고 매 1초마다 아군의 생명력을 [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 85 / 100]만큼 회복시킵니다."},
[402864] = {name = "투구 각인술 - 공허의 눈", additional_info = "3 초 주문 시전 시간\n투구 필요\n[q]투구에 공허의 눈 룬을 새깁니다.\n\n\n공허의 눈을 불러내 30 sec 동안 전투를 돕게 합니다. 눈은 대상에게 여러 저주를 겁니다."},
[402877] = {name = "채찍질", additional_info = "[q]피의 분노 또는 광전사의 격노를 활성화한 후 12 sec 동안 물리 공격력이 추가로 25%만큼 증가합니다."},
[402906] = {name = "채찍질", additional_info = nil},
[402911] = {name = "분노의 강타", additional_info = "근접 사정거리\n즉시 8 초 재사용 대기시간\n근접 무기 필요\n[q]흉포한 강타를 날려 무기 공격력의 80%에 해당하는 피해를 입힙니다. 격노, 광전사의 격노, 피의 분노가 활성화됐을 때만 사용할 수 있습니다."},
[402913] = {name = "분노의 재생력", additional_info = "즉시 3 분 재사용 대기시간\n[q]10 sec에 걸쳐 최대 생명력의 30%를 회복합니다. 격노, 광전사의 격노, 피의 분노가 활성화됐을 때만 사용할 수 있습니다. 기절한 상태에서 사용 가능합니다."},
[402922] = {name = "정확한 시간 감각", additional_info = "[q]격돌이 즉시 시전되지만 6초의 재사용 대기시간이 적용됩니다."},
[402927] = {name = "승리의 돌진", additional_info = "근접 사정거리\n즉시 8 초 재사용 대기시간\n[q]즉시 대상을 공격하여 (1 + Attack power * 45 / 100)의 피해를 입히고 최대 생명력의 10%에 해당하는 생명력을 회복합니다. 자신이 결정타를 가하여 적을 처치한 후 경험치나 명예 점수를 받게 된 지 20 sec 내에만 사용할 수 있습니다."},
[402975] = {name = "승리", additional_info = "즉시\n[q]적 처치 후 뒤따릅니다."},
[403172] = {name = "룬조각술: 각인술 - 미간 적중 배우기", additional_info = nil},
[403195] = {name = "압도", additional_info = "[q]방어 태세가 활성화되어 있고 방패를 착용 중일 때 방어구 가르기가 1초마다 장착한 무기 공격력의 150%에 해당하는 추가 피해를 입힙니다. 대상에게 이미 부여된 방어구 가르기 중첩 하나당 효과가 10%만큼 증가합니다."},
[403196] = {name = "압도", additional_info = "사정거리 없음\n즉시\n근접 무기 필요\n[q]방어구 가르기가 무기 공격력의 150%에 해당하는 추가 피해를 입힙니다. 대상에게 이미 부여된 방어구 가르기 중첩 하나당 효과가 10%만큼 증가합니다."},
[403215] = {name = "지휘의 외침", additional_info = "분노 10\n즉시 시전\n[q]전사의 외침으로 주위 30미터 반경에 있는 모든 파티원의 체력이 2만큼 증가됩니다. 2 min 동안 지속됩니다."},
[403218] = {name = "끝없는 분노", additional_info = "[q]모든 피해를 입힐 때 생성되는 분노가 25%만큼 증가합니다."},
[403219] = {name = "격노의 천둥", additional_info = "[q]천둥벼락 사용 시 공격 간격을 추가로 6%만큼 증가시키며 태세에 상관없이 사용할 수 있습니다. 또한 100%의 추가 피해를 입히고, 위협 수준이 50%만큼 증가합니다."},
[403332] = {name = "영웅의 사격", additional_info = "8 - 35 야드 사정거리\n6 초 재사용 대기시간\n원거리 무기 필요\n[q]대상에게 사격하여 원거리 무기 공격력의 300%에 해당하는 피해를 입힙니다. 20의 분노를 생성합니다."},
[403338] = {name = "가로막기", additional_info = "분노 10 8 - 25 야드 사정거리\n즉시 시전 30 초 재사용 대기시간\n방어 태세 필요\n[q]빠른 속도로 대상 파티원에게 달려가 파티원에게 적중할 다음 근접 또는 원거리 공격을 대신 맞고 전체 위협 수준을 10%만큼 감소시킵니다."},
[403339] = {name = "가로막기", additional_info = nil},
[403344] = {name = "채찍질", additional_info = "[q]채찍질 능력을 얻습니다.\n\n\n피의 분노 또는 광전사의 격노를 활성화한 후 12 sec 동안 물리 공격력이 추가로 25%만큼 증가합니다."},
[403349] = {name = "끝없는 분노", additional_info = "[q]끝없는 분노 능력을 얻습니다.\n\n\n모든 피해를 입힐 때 생성되는 분노가 25%만큼 증가합니다."},
[403352] = {name = "피의 광란", additional_info = "[q]피의 광란 능력을 얻습니다.\n\n\n출혈 피해를 입힐 때마다 3의 분노를 생성합니다."},
[403355] = {name = "압도", additional_info = "[q]압도 능력을 얻습니다.\n\n\n방어 태세가 활성화되어 있고 방패를 착용 중일 때 방어구 가르기가 1초마다 장착한 무기 공격력의 150%에 해당하는 추가 피해를 입힙니다. 대상에게 이미 부여된 방어구 가르기 중첩 하나당 효과가 10%만큼 증가합니다."},
[403356] = {name = "격노의 천둥", additional_info = "[q]격노의 천둥 능력을 얻습니다.\n\n\n천둥벼락 사용 시 공격 간격을 추가로 6%만큼 증가시키며 태세에 상관없이 사용할 수 있습니다. 또한 100%의 추가 피해를 입히고, 위협 수준이 50%만큼 증가합니다."},
[403359] = {name = "분노의 재생력", additional_info = "[q]분노의 재생력 능력을 얻습니다.\n\n\n10 sec에 걸쳐 최대 생명력의 30%를 회복합니다. 격노, 광전사의 격노, 피의 분노가 활성화됐을 때만 사용할 수 있습니다. 기절한 상태에서 사용 가능합니다."},
[403434] = {name = "승리의 돌진", additional_info = "[q]승리의 돌진 능력을 얻습니다.\n\n\n 즉시 대상을 공격하여 (1 + Attack power * 45 / 100)의 피해를 입히고 최대 생명력의 10%에 해당하는 생명력을 회복합니다. 자신이 결정타를 가하여 적을 처치한 후 경험치나 명예 점수를 받게 된 지 20 sec 내에만 사용할 수 있습니다."},
[403435] = {name = "지휘의 외침", additional_info = "[q]지휘의 외침 능력을 얻습니다.\n\n\n전사의 외침으로 주위 30미터 반경에 있는 모든 파티원의 체력이 2만큼 증가됩니다. 2 min 동안 지속됩니다."},
[403437] = {name = "가로막기", additional_info = "[q]가로막기 능력을 얻습니다.\n\n\n빠른 속도로 대상 파티원에게 달려가 파티원에게 적중할 다음 근접 또는 원거리 공격을 대신 맞고 전체 위협 수준을 10%만큼 감소시킵니다."},
[403446] = {name = "바지 각인술 - 지휘의 외침", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 지휘의 외침 룬을 새깁니다.\n\n\n전사의 외침으로 주위 30미터 반경에 있는 모든 파티원의 체력이 2만큼 증가됩니다. 2 min 동안 지속됩니다."},
[403467] = {name = "장화 각인술 - 분노의 재생력", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 분노의 재생력 룬을 새깁니다.\n\n\n10 sec에 걸쳐 최대 생명력의 30%를 회복합니다. 격노, 광전사의 격노, 피의 분노가 활성화됐을 때만 사용할 수 있습니다. 기절한 상태에서 사용 가능합니다."},
