[403472] = {name = "장화 각인술 - 가로막기", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 가로막기 룬을 새깁니다.\n\n\n빠른 속도로 대상 파티원에게 달려가 파티원에게 적중할 다음 근접 또는 원거리 공격을 대신 맞고 전체 위협 수준을 10%만큼 감소시킵니다."},
[403474] = {name = "가슴보호구 각인술 - 피의 광란", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구에 피의 광란 룬을 새깁니다.\n\n\n출혈 피해를 입힐 때마다 3의 분노를 생성합니다."},
[403475] = {name = "장갑 각인술 - 압도", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 압도 룬을 새깁니다.\n\n\n방어 태세가 활성화되어 있고 방패를 착용 중일 때 방어구 가르기가 1초마다 장착한 무기 공격력의 150%에 해당하는 추가 피해를 입힙니다. 대상에게 이미 부여된 방어구 가르기 중첩 하나당 효과가 10%만큼 증가합니다."},
[403476] = {name = "바지 각인술 - 격노의 천둥", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 격노의 천둥 룬을 새깁니다.\n\n\n천둥벼락 사용 시 공격 간격을 추가로 6%만큼 증가시키며 태세에 상관없이 사용할 수 있습니다. 또한 100%의 추가 피해를 입히고, 위협 수준이 50%만큼 증가합니다."},
[403480] = {name = "가슴보호구 각인술 - 채찍질", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구에 채찍질 룬을 새깁니다.\n\n\n피의 분노 또는 광전사의 격노를 활성화한 후 12 sec 동안 물리 공격력이 추가로 25%만큼 증가합니다."},
[403489] = {name = "장갑 각인술 - 끝없는 분노", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 끝없는 분노 룬을 새깁니다.\n\n\n모든 피해를 입힐 때 생성되는 분노가 25%만큼 증가합니다."},
[403501] = {name = "유령 출몰", additional_info = "12% (기본 마나 중) 30 야드 사정거리\n즉시 12 초 재사용 대기시간\n[q]적에게 유령의 영혼을 방출해 [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 251 / 100]에서 [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 295 / 100]의 피해를 입히고 대상에게 입히는 모든 지속 암흑 피해가 20%만큼 증가합니다. 유령 출몰이 끝나거나 무효화되면 대상에게 입힌 모든 피해만큼 생명력을 회복합니다."},
[403506] = {name = "유령 출몰", additional_info = nil},
[403511] = {name = "영혼 착취", additional_info = "[q]생명력 흡수로 흡수하는 생명력과 영혼 흡수로 입히는 피해가 대상에 걸려 있는 자신의 흑마법사의 암흑 효과마다 6%만큼씩 증가합니다. 추가 효과는 최대 18%까지 증가합니다."},
[403628] = {name = "연발 어둠의 화살", additional_info = "[q]어둠의 화살이 10미터 내에 있는 최대 5명의 추가 적을 공격합니다. 공격력은 20%만큼 감소합니다."},
[403629] = {name = "혼돈의 화살", additional_info = "7% (기본 마나 중) 30 야드 사정거리\n2.5 초 주문 시전 시간 12 초 재사용 대기시간"},
[403630] = {name = "혼돈의 화살", additional_info = nil},
[403650] = {name = "불꽃의 호수", additional_info = "100 야드 사정거리\n즉시\n[q]불의 비가 지면에 불꽃의 호수를 남깁니다. 호수에 영향을 받는 적은 시전자와 시전자의 악마 소환수에게 받는 모든 화염 피해가 50%만큼 증가합니다."},
[403666] = {name = "불꽃의 호수", additional_info = "[q]전체 지속시간 동안 정신 집중하면 불의 비가 지면에 불꽃의 호수를 남깁니다. 호수에 영향을 받는 적은 15 sec 동안 시전자와 시전자의 악마 소환수에게 받는 모든 화염 피해가 50%만큼 증가합니다."},
[403668] = {name = "역술의 대가", additional_info = "[q]생명력 흡수가 더는 정신을 집중하지 않습니다. 15 sec 동안 지속되며 15 sec의 재사용 대기시간이 적용됩니다. 또한 마나 소모량이 100%만큼 증가하며, 피해를 입힐 때마다 50%만큼 추가로 생명력을 회복합니다."},
[403677] = {name = "생명력 흡수", additional_info = "마나 110 20 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]대상으로부터 매초마다 10의 생명력을 흡수합니다. 15 sec 동안 지속됩니다."},
