[403687] = {name = "생명력 흡수", additional_info = "마나 370 20 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]대상으로부터 매초마다 41의 생명력을 흡수합니다. 15 sec 동안 지속됩니다."},
[403688] = {name = "생명력 흡수", additional_info = "마나 480 20 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]대상으로부터 매초마다 55의 생명력을 흡수합니다. 15 sec 동안 지속됩니다."},
