[403789] = {name = "탈태", additional_info = "100% (기본 마나 중)\n즉시\n[q]악마로 변신해 방어도가 500%만큼 증가하고 치명타에 적중당할 확률이 6%만큼 감소합니다. 위협 수준이 50%만큼, 생명력 전환으로 회복하는 마나가 100%만큼 증가합니다. 몇몇 능력의 변화 및 신규 능력을 얻습니다.\n\n 불타는 고통: 즉시 시전됩니다.\n\n 어둠의 화살: 어둠의 화살: 어둠의 회전베기로 변화합니다. 암흑 근접 공격으로 주위 최대 3명의 적을 가격하지만, 6초의 재사용 대기시간이 적용됩니다.\n\n 공포: 위협으로 대체됩니다.\n\n\n적을 도발하여 자신을 공격하도록 만듭니다. 이미 자신을 공격하고 있다면 아무런 효과를 발휘하지 못합니다.\n\n 악마의 돌진\n\n\n적에게 돌진하여 1 sec 동안 기절시킵니다. 전투 중에는 사용할 수 없습니다.\n\n 악마의 포효\n\n\n6 sec 동안 주위 모든 적이 자신에게 공격을 집중하도록 만듭니다."},
[403816] = {name = "탈태", additional_info = "[q]악마로 변신합니다. 방어도가 500%만큼 증가하고 치명타에 적중당할 확률이 6%만큼 감소합니다. 위협 수준을 50%만큼 추가로 생성하며, 생명력 전환으로 회복하는 마나가 100%만큼 증가합니다. 몇몇 능력의 기능이 변화합니다.\n\n 불타는 고통: 즉시 시전됩니다.\n\n 어둠의 화살: 어둠의 회전베기로 변화합니다. 주위에 있는 최대 500명의 적을 가격하는 암흑 근접 공격입니다.\n\n 무모함의 저주: 효과가 추가되어, 대상을 도발해 until cancelled 동안 자신을 공격하게 합니다.\n\n 공포의 울부짖음: 효과가 추가되어 until cancelled 동안 주위의 모든 적이 자신을 공격하게 합니다. 재사용 대기시간이 10분으로 증가합니다."},
