[403858] = {name = "유령 출몰", additional_info = "[q]유령 출몰 능력을 얻습니다.\n\n\n적에게 유령의 영혼을 방출해 [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 251 / 100]에서 [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 295 / 100]의 피해를 입히고 대상에게 입히는 모든 지속 암흑 피해가 20%만큼 증가합니다. 유령 출몰이 끝나거나 무효화되면 대상에게 입힌 모든 피해만큼 생명력을 회복합니다."},
