[403863] = {name = "영혼 착취", additional_info = "[q]영혼 착취 능력을 얻습니다.\n\n\n생명력 흡수로 흡수하는 생명력과 영혼 흡수로 입히는 피해가 대상에 걸려 있는 자신의 흑마법사의 암흑 효과마다 6%만큼씩 증가합니다. 추가 효과는 최대 18%까지 증가합니다."},
[403868] = {name = "역술의 대가", additional_info = "[q]역술의 대가 능력을 얻습니다.\n\n\n생명력 흡수가 더는 정신을 집중하지 않습니다. 15 sec 동안 지속되며 15 sec의 재사용 대기시간이 적용됩니다. 또한 마나 소모량이 100%만큼 증가하며, 피해를 입힐 때마다 50%만큼 추가로 생명력을 회복합니다."},
[403871] = {name = "연발 어둠의 화살", additional_info = "[q]연발 어둠의 화살 능력을 얻습니다.\n\n\n어둠의 화살이 10미터 내에 있는 최대 5명의 추가 적을 공격합니다. 공격력은 20%만큼 감소합니다."},
[403872] = {name = "불꽃의 호수", additional_info = "[q]불꽃의 호수 능력을 얻습니다.\n\n\n전체 지속시간 동안 정신 집중하면 불의 비가 지면에 불꽃의 호수를 남깁니다. 호수에 영향을 받는 적은 15 sec 동안 시전자와 시전자의 악마 소환수에게 받는 모든 화염 피해가 50%만큼 증가합니다."},
[403873] = {name = "탈태", additional_info = "[q]탈태 능력을 얻습니다.\n\n\n 악마로 변신해 방어도가 500%만큼 증가하고 치명타에 적중당할 확률이 6%만큼 감소합니다. 위협 수준이 50%만큼, 생명력 전환으로 회복하는 마나가 100%만큼 증가합니다. 몇몇 능력의 변화 및 신규 능력을 얻습니다.\n\n 불타는 고통: 즉시 시전됩니다.\n\n 어둠의 화살: 어둠의 화살: 어둠의 회전베기로 변화합니다. 암흑 근접 공격으로 주위 최대 3명의 적을 가격하지만, 6초의 재사용 대기시간이 적용됩니다.\n\n 공포: 위협으로 대체됩니다.\n\n\n적을 도발하여 자신을 공격하도록 만듭니다. 이미 자신을 공격하고 있다면 아무런 효과를 발휘하지 못합니다.\n\n 악마의 돌진\n\n\n적에게 돌진하여 1 sec 동안 기절시킵니다. 전투 중에는 사용할 수 없습니다.\n\n 악마의 포효\n\n\n6 sec 동안 주위 모든 적이 자신에게 공격을 집중하도록 만듭니다."},
