[407613] = {name = "빛의 봉화", additional_info = "7% (기본 마나 중) 40 야드 사정거리\n즉시\n[q]대상은 40미터 반경 내에 있는 모든 파티원과 공격대원에게 빛의 봉화가 됩니다. 해당 범위 내에 있는 파티원 또는 공격대원에게 시전하는 자신의 치유 주문은 회복시킨 생명력의 100%만큼 봉화가 된 대상의 생명력을 회복시킵니다. 동시에 오직 하나의 대상만 빛의 봉화가 될 수 있습니다. 1 min 동안 지속됩니다."},
