[407627] = {name = "정의의 격노", additional_info = "즉시\n[q]신성 주문의 위협 생성 수준이 80%만큼 증가하며, 다른 아군 대상의 주문으로 치유를 받으면 치유량의 25%만큼 마나를 회복합니다. 추가로 생명력이 35% 미만으로 떨어질 수 있는 공격을 받으면 그 공격으로 받는 피해가 20%만큼 감소합니다. until cancelled 동안 지속됩니다."},
[407628] = {name = "정의의 격노", additional_info = "즉시\n[q]치유 효과를 받으면 마나를 회복합니다."},
[407631] = {name = "심판의 손길", additional_info = "근접 사정거리\n즉시 10 초 재사용 대기시간\n[q]적을 도발하여 자신을 공격하도록 만듭니다. 이미 자신을 공격하고 있다면 아무런 효과를 발휘하지 못합니다.\n\n 이 능력을 배웠다면 정의의 격노의 위협 수준 증가량이 80%로 증가합니다. 또한 정의의 격노가 받는 치유 효과의 25%만큼 마나를 회복시킵니다. 추가로 정의의 격노가 활성화된 동안 생명력이 35% 미만으로 떨어질 수 있는 공격을 받으면 그 공격으로 받는 피해가 20%만큼 감소합니다. 취소할 때까지 정의의 격노가 지속됩니다."},
[407632] = {name = "정의의 망치", additional_info = "6% (기본 마나 중) 근접 사정거리\n즉시 6 초 재사용 대기시간\n[q]대상과 주위 최대 2명의 대상에게 주장비 초당 공격력의 4배에 해당하는 신성 피해를 입힙니다."},
[407653] = {name = "갈래 번개", additional_info = "30 야드 사정거리\n즉시\n[q]주위 적을 연이어 공격하는 번개 화살로 대상을 강타합니다. 최대 0개의 목표를 가격하여 각각 자연 피해를 입힙니다."},
[407667] = {name = "갈래 번개", additional_info = "30 야드 사정거리\n즉시\n[q]주위 모든 대상을 연이어 공격하는 번개 화살로 대상을 강타해, 각각 자연 피해를 입힙니다."},
[407669] = {name = "응징의 방패", additional_info = "26% (기본 마나 중) 30 야드 사정거리\n즉시 30 초 재사용 대기시간\n[q]적에게 신성한 방패를 날려 [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power]에서 [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power]의 신성 피해를 입히고 멍해지도록 만듭니다. 주위 적을 연쇄적으로 가격하며 최대 3명의 대상을 공격합니다. 10 sec 동안 지속됩니다."},
[407676] = {name = "성전사의 일격", additional_info = "근접 사정거리\n즉시 6 초 재사용 대기시간\n근접 무기 필요\n[q]적에게 즉시 일격을 가하여 무기 공격력의 75%에 해당하는 신성 피해를 입히고 최대 마나의 5%를 회복합니다."},
[407720] = {name = "갈래 번개", additional_info = "30 야드 사정거리\n즉시\n[q]주위 적을 연이어 공격하는 번개 화살로 대상을 강타합니다. 최대 0개의 목표를 가격하여 각각 자연 피해를 입힙니다."},
[407736] = {name = "갈래 번개", additional_info = "30 야드 사정거리\n즉시\n[q]주위 적을 연이어 공격하는 번개 화살로 대상을 강타합니다. 최대 0개의 목표를 가격하여 각각 자연 피해를 입힙니다."},
