[407778] = {name = "천상의 폭풍", additional_info = "12% (기본 마나 중)\n즉시 10 초 재사용 대기시간\n근접 무기 필요\n[q]즉시 무기로 공격하여 8미터 반경 내에 있는 최대 4명의 적에게 무기 공격력의 110%에 해당하는 피해를 입힙니다. 또한 입힌 피해의 최대 25%만큼 최대 3명의 파티원 혹은 공격대원의 생명력을 회복시킵니다."},
[407782] = {name = "천상의 폭풍", additional_info = "100 야드 사정거리\n즉시\n[q]천상의 폭풍으로 피해를 입히면 아군 대상을 치유합니다."},
[407784] = {name = "천상의 폭풍", additional_info = "사정거리 없음\n즉시\n[q]천상의 폭풍으로 피해를 입히면 주위 아군 대상을 치유합니다."},
[407791] = {name = "아쿠마이의 분노", additional_info = "즉시\n[q]15 sec 동안 시전자의 물리 공격력이 25만큼 공격 속도가 30%만큼 증가합니다."},
[407794] = {name = "삼중 꿰뚫기", additional_info = "근접 사정거리\n즉시\n[q]15 sec에 걸쳐 매 3초마다 물리 피해를 입힙니다.\n(1초 재사용 대기시간)"},
[407798] = {name = "헌신의 문장", additional_info = "4% (기본 마나 중)\n즉시"},
[407799] = {name = "헌신의 문장", additional_info = nil},
[407800] = {name = "헌신의 문장", additional_info = "즉시\n[q]헌신의 문장이 성기사에게도 피해를 입힙니다."},
[407802] = {name = "헌신의 문장", additional_info = "40 야드 사정거리\n즉시\n[q]성기사가 받는 피해에 따라 마나를 회복합니다."},
[407803] = {name = "헌신의 심판", additional_info = nil},
[407804] = {name = "성스러운 희생", additional_info = "즉시 2 분 재사용 대기시간\n[q]10 sec 동안 30미터 반경 내에 있는 파티원이 받는 모든 피해의 30%에 해당하는 피해를 자신에게 이전시킵니다. 성기사의 생명력이 20% 미만으로 감소하는 피해를 입으면 효과가 해제되고 10 sec 동안 공격력과 치유량이 10%만큼 증가합니다. 보호의 축복, 천상의 보호막, 신의 가호 효과를 받는 동안에는 성스러운 희생을 사용할 수 없으며, 추가로 성스러운 희생이 활성화된 동안에는 해당 능력의 대상으로 지정하지 못합니다."},
[407805] = {name = "희생의 구원", additional_info = "즉시 3 분 재사용 대기시간\n[q]희생 후 공격력과 치유량이 증가합니다."},
[407811] = {name = "회전베기", additional_info = "근접 사정거리\n다음 근접\n[q]목표 적과 그 주위의 적에게 무기 공격력에 추가로 23 to 27의 피해를 입힙니다. 최대 3개의 대상에게 영향을 미칩니다."},
[407812] = {name = "얼음의 화살에 면역", additional_info = nil},
[407813] = {name = "냉기 화살", additional_info = "5 - 30 야드 사정거리\n1 초 주문 시전 시간\n원거리 무기 필요\n[q]적에게 발사하여 물리 피해를 입힙니다."},
[407819] = {name = "냉기 화살", additional_info = "50 야드 사정거리\n1.5 초 주문 시전 시간\n원거리 무기 필요\n[q]적에게 발사하여 물리 피해를 입힙니다."},
[407821] = {name = "냉기 화살", additional_info = "50 야드 사정거리\n즉시\n원거리 무기 필요\n[q]적에게 발사하여 물리 피해를 입힙니다."},
[407822] = {name = "냉기 화살", additional_info = nil},
[407880] = {name = "영감의 모범", additional_info = "2% (기본 마나 중)\n즉시\n[q]고무적인 존재감이 주기적으로 주위 파티원의 공포 및 수면 효과를 무효화합니다."},
[407881] = {name = "영감의 모범", additional_info = "즉시\n[q]고무적인 존재감이 주기적으로 주위 파티원의 공포 및 수면 효과를 무효화합니다."},
[407973] = {name = "야생의 강타", additional_info = "100 야드 사정거리\n즉시\n[q]추가 공격을 가합니다."},
[407975] = {name = "야생의 강타", additional_info = "즉시\n[q]20미터 내 파티원이 좀 더 매섭게 전투를 수행합니다. 근접 공격이 적중할 때마다 20%으 확률로 공격자가 재차 공격을 가해 전투력의 20%에 해당하는 추가 피해를 입힙니다. 파티원이 이미 질풍의 토템의 효과를 받는 경우 효과를 발휘하지 않습니다.\n(효과 발동 확률: 20%, 1.5초 재사용 대기시간)"},
[407977] = {name = "야생의 강타", additional_info = "[q]표범 변신, 곰 변신 또는 광포한 곰 변신 상태일 때 20미터 내 파티원이 좀 더 매섭게 전투를 수행합니다. 근접 공격이 적중할 때마다 20%으 확률로 공격자가 재차 공격을 가해 전투력의 20%에 해당하는 추가 피해를 입힙니다. 파티원이 이미 질풍의 토템의 효과를 받는 경우 효과를 발휘하지 않습니다."},
[407988] = {name = "야생의 포효", additional_info = "기력 25 100 야드 사정거리\n즉시\n[q]마무리 일격을 날려 물리 공격력을 30%만큼 증가시킵니다. 표범 변신 상태일 때 사용할 수 있습니다. 연계 점수 당 다음 시간 동안 지속됩니다.\n 연계 점수 1점: 14초\n 연계 점수 2점: 19초\n 연계 점수 3점: 24초\n 연계 점수 4점: 29초\n 연계 점수 5점: 34초"},
[407989] = {name = "야생의 포효", additional_info = "즉시\n표범 변신 필요\n[q]마무리 일격을 날려 물리 공격력을 30%만큼 증가시킵니다. 연계 점수당 다음 시간 동안 지속됩니다.\n 연계 점수 1점: 14초\n 연계 점수 2점: 19초\n 연계 점수 3점: 24초\n 연계 점수 4점: 29초\n 연계 점수 5점: 34초"},
[407993] = {name = "짓이기기", additional_info = "기력 40 근접 사정거리\n즉시\n표범 변신 필요\n[q]대상을 짓이겨 일반 공격력의 270%에 해당하는 피해를 입히고 1 min 동안 출혈 효과 및 칼날 발톱으로 받는 피해를 30%만큼 추가로 증가시킵니다. 연계 점수 1점을 생성합니다. 이 능력은 할퀴기 및 후려치기와 관련된 모든 이로운 효과를 적용 및 발동시킵니다."},
[407995] = {name = "짓이기기", additional_info = "분노 15 근접 사정거리\n즉시 시전 6 초 재사용 대기시간\n곰 변신, 광포한 곰 변신 필요\n[q]대상을 짓이겨 일반 공격력의 160%에 해당하는 피해를 입히고 1 min 동안 출혈 효과 및 칼날 발톱으로 받는 피해를 30%만큼 추가로 증가시킵니다. 이 능력은 할퀴기 및 후려치기와 관련된 모든 이로운 효과를 적용 및 발동시킵니다."},
[408013] = {name = "검은심연 정예병 생성기", additional_info = nil},
[408014] = {name = "검은심연 정예병 생성", additional_info = nil},
[408024] = {name = "생존 본능", additional_info = "즉시 3 분 재사용 대기시간\n[q]활성화 시 20 sec 동안 최대 생명력의 30%만큼 생명력이 증가합니다. 이 효과가 만료되면 임시 생명력은 사라집니다. 모든 변신 상태에서 사용할 수 있습니다.\n\n 추가로 곰 변신 또는 광포한 곰 변신 상태로 회피할 때마다 5의 분노를 생성합니다. 표범 변신 상태로 회피할 때는 10의 기력을 회복하며, 그 외의 변신 상태일 때는 최대 마나의 1%를 회복합니다."},
[408025] = {name = "생존 본능", additional_info = nil},
[408030] = {name = "룬조각술: 각인술 - 영혼 착취 배우기", additional_info = nil},
[408035] = {name = "다미엔 케인 - 영혼을 룬으로 교환", additional_info = nil},
[408120] = {name = "급속 성장", additional_info = "56% (기본 마나 중) 40 야드 사정거리\n즉시 6 초 재사용 대기시간\n[q]7 sec에 걸쳐 대상 플레이어의 40미터 내에 있는 모든 파티원의 생명력을 [34 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]만큼 회복시킵니다. 처음엔 생명력을 빠르게 회복시키다가 시간이 지날수록 점점 느려집니다."},
[408124] = {name = "피어나는 생명", additional_info = "14% (기본 마나 중) 40 야드 사정거리\n즉시\n[q]7 sec에 걸쳐 대상의 생명력을 [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]만큼 회복시킵니다. 피어나는 생명의 지속시간이 다하거나 무효화되면 대상은 그 즉시 [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]의 생명력을 회복하고 드루이드는 주문 시전에 소모한 자원의 절반을 회복합니다. 이 효과는 같은 대상에 대해 3번까지 중복될 수 있습니다."},
[408245] = {name = "피어나는 생명", additional_info = "40 야드 사정거리\n즉시\n[q]7초에 걸쳐 대상의 생명력을 회복시킵니다. 피어나는 생명의 지속시간이 다하거나 무효화되면 대상은 그 즉시 생명력을 회복합니다. 이 효과는 같은 대상에 대해 3번까지 중복될 수 있습니다."},
[408246] = {name = "피어나는 생명", additional_info = "즉시\n[q]피어나는 생명 만료 시 마나를 회복합니다."},
[408247] = {name = "육성", additional_info = "26% (기본 마나 중) 40 야드 사정거리\n2 초 주문 시전 시간\n[q]아군 대상의 생명력을 [161 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]에서 [189 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]만큼 회복시킵니다. 회복, 재생, 피어나는 생명, 급속 성장 효과가 걸려 있는 대상은 회복되는 생명력이 20%만큼 증가합니다. 이 주문은 치유의 손길과 관련된 모든 이로운 효과를 적용 및 발동시킵니다."},
[408248] = {name = "일월식", additional_info = "[q]별빛 화살이 다음 2회 동안 시전하는 천벌의 치명타 및 극대화율을 30%만큼 증가시킵니다. 또한 천벌은 다음 별빛 화살의 시전 시간을 1.0초만큼 감소시킵니다. 두 효과는 최대 4번까지 중첩됩니다. 두 주문을 시전할 때 피해를 받을 경우 70%의 확률로 시전 시간을 잃지 않습니다."},
[408250] = {name = "일월식: 태양", additional_info = "즉시\n[q]천벌의 치명타 및 극대화율이 증가합니다."},
[408255] = {name = "일월식: 달", additional_info = nil},
