[408309] = {name = "엘룬의 우아함", additional_info = "즉시 2 분 재사용 대기시간\n[q]주문 공격력이 치유력과 주문 공격력 편차의 55%만큼 증가합니다. 30 sec 동안 지속됩니다."},
[408339] = {name = "불꽃 회오리", additional_info = "[q]불꽃 회오리 토템 주문이 불꽃 회오리로 대체됩니다. 불꽃 회오리 시전 시 현재 활성화된 불의 토템이 자신의 위치에 피해를 발산합니다."},
