[408479] = {name = "연쇄 번개", additional_info = "30 야드 사정거리\n즉시\n[q]적에게 번개를 날려 99 to 114의 자연 피해를 입히고 주위 적을 연쇄적으로 가격합니다. 대상이 바뀔 때마다 피해는 30%씩 감소됩니다. 최대 3명의 대상을 공격합니다."},
[408481] = {name = "연쇄 번개", additional_info = "30 야드 사정거리\n즉시\n[q]적에게 번개를 날려 143 to 162의 자연 피해를 입히고 주위 적을 연쇄적으로 가격합니다. 대상이 바뀔 때마다 피해는 30%씩 감소됩니다. 최대 3명의 대상을 공격합니다."},
[408482] = {name = "연쇄 번개", additional_info = "30 야드 사정거리\n즉시\n[q]적에게 번개를 날려 195 to 219의 자연 피해를 입히고 주위 적을 연쇄적으로 가격합니다. 대상이 바뀔 때마다 피해는 30%씩 감소됩니다. 최대 3명의 대상을 공격합니다."},
[408484] = {name = "연쇄 번개", additional_info = "30 야드 사정거리\n즉시\n[q]적에게 번개를 날려 252 to 283의 자연 피해를 입히고 주위 적을 연쇄적으로 가격합니다. 대상이 바뀔 때마다 피해는 30%씩 감소됩니다. 최대 3명의 대상을 공격합니다."},
[408490] = {name = "용암 폭발", additional_info = "10% (기본 마나 중) 30 야드 사정거리\n2 초 주문 시전 시간 8 초 재사용 대기시간\n[q]대상에게 녹아내리는 용암을 날려 [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)]에서 [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)]의 화염 피해를 입힙니다. 대상에 화염 충격 효과가 걸려 있으면 치명타로 적중합니다."},
[408491] = {name = "용암 폭발", additional_info = "30 야드 사정거리\n즉시\n[q]대상에게 녹아내리는 용암을 날려 [234 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)]에서 [303 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)]의 화염 피해를 입힙니다. 대상에 화염 충격 효과가 걸려 있으면 치명타로 적중합니다."},
[408496] = {name = "쌍수 무기 전문화", additional_info = "[q]쌍수 무기 사용 시 주문 및 근접 공격이 적중할 확률이 10%만큼 증가합니다. 쌍수 무기를 사용하는 동안에는 폭풍의 일격이 두 무기로 적중합니다. 또한 보조 무기의 공격력이 50%만큼 증가합니다."},
[408498] = {name = "소용돌이치는 무기", additional_info = "[q]근접 공격으로 피해를 입히면 일정 확률로 다음 번개 화살, 연쇄 번개, 하급 치유의 물결, 치유의 물결, 연쇄 치유 또는 용암 폭발 주문의 시전 시간과 마나 소모량이 20%만큼 감소합니다. 주 무기에 질풍의 무기가 부여되어 있다면 발동 확률이 50%만큼 증가합니다. 5번까지 중복됩니다. 30 sec 동안 지속됩니다."},
[408501] = {name = "소용돌이 준비!", additional_info = nil},
[408505] = {name = "소용돌이치는 무기", additional_info = "즉시\n[q]다음 번개 화살, 연쇄 번개, 하급 치유의 물결, 치유의 물결, 연쇄 치유 주문의 시전 시간과 마나 소모량이 20%만큼 감소합니다."},
[408507] = {name = "용암 채찍", additional_info = "1% (기본 마나 중) 근접 사정거리\n즉시 6 초 재사용 대기시간\n근접 무기 필요\n[q]보조 무기에 용암의 열기를 주입하여 즉시 보조 무기 공격력의 100%에 해당하는 피해를 입힙니다. 보조 무기에 불꽃의 무기 효과가 활성화되어 있으면 피해가 125%만큼 증가합니다."},
[408510] = {name = "물의 보호막", additional_info = "즉시\n[q]3개의 물방울이 시전자의 주위에 머무르며 5초마다 최대 마나의 1%를 회복합니다. 만약 시전자가 주문이나 근접 또는 원거리 공격에 적중 당하면 시전자는 물방울로부터 최대 마나의 4%를 흡수합니다. 매번 마나를 흡수할 때마다 물방울이 하나씩 사라집니다. 물방울이 하나 사라지면 다른 물방울이 효력을 발휘하기까지 일정 시간이 필요합니다. 10 min 동안 지속됩니다. 주술사의 보호막은 동시에 하나만 유지할 수 있습니다.\n(3.5초 재사용 대기시간)"},
[408511] = {name = "물의 보호막", additional_info = "즉시\n[q]물의 보호막이 활성화된 동안 적중당하면 마나를 회복합니다."},
[408514] = {name = "대지의 보호막", additional_info = "5% (기본 마나 중) 40 야드 사정거리\n즉시\n[q]대상을 대지의 보호막으로 감싸 피해를 입을 시 정신 집중이나 주문 시전이 지연되는 시간이 30%만큼 감소하게 하고 보호막이 걸린 대상이 공격을 받을 시 [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100]의 생명력을 회복하도록 합니다. 이 효과는 몇초마다 한 번씩만 발휘됩니다. 9회 사용 가능하며 10 min 동안 지속됩니다. 대지의 보호막은 동시에 한 대상에게만 걸 수 있으며 주술사의 보호막은 대상마다 동시에 하나만 효과를 발휘할 수 있습니다.\n(3.5초 재사용 대기시간)"},
[408519] = {name = "대지의 보호막", additional_info = "사정거리 없음\n즉시\n[q]대지의 보호막으로 치유되었습니다."},
[408521] = {name = "성난 해일", additional_info = "18% (기본 마나 중) 40 야드 사정거리\n즉시 6 초 재사용 대기시간\n[q]아군 대상의 생명력을 [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]에서 [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]만큼 회복시키고 15 sec에 걸쳐 [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]의 생명력을 회복시킵니다. 15 sec 내에 대상에게 시전하는 다음 연쇄 치유 주문은 지속적인 치유 효과를 흡수하여 연쇄 치유의 치유 효과를 25%만큼 증가시킵니다. 또한 이 주문은 고대의 각성을 발동시킵니다."},
[408524] = {name = "방패 숙련", additional_info = "[q]방패 막기에 성공할 때마다 최대 마나의 8%에 해당하는 마나를 회복하고 방어도가 방패 방어도의 30%만큼 증가합니다. 최대 5번까지 중첩됩니다. 또한 항상 방패 막기 확률이 10%만큼, 방패 막기 수치가 15%만큼 증가합니다."},
[408525] = {name = "방패 숙련", additional_info = "즉시\n[q]15 sec 동안 방어도가 방패 방어도의 30%만큼 증가합니다. 최대 5번까지 중첩됩니다."},
[408531] = {name = "대지의 길", additional_info = "[q]주무기에 대지의 무기가 활성화되어 있고 방패를 장착 중일 경우 위협 수준이 50%만큼, 생명력이 30%만큼 증가합니다. 받는 피해는 10%만큼, 근접 공격 치명타에 적중당할 확률도 6%만큼 감소합니다. 또한 대지 충격 시전 시 대상을 도발해 자신을 공격하게 하고 다른 충격 주문과 재사용 대기시간이 분리됩니다. 사정거리가 근접 공격 범위로 감소합니다."},
[408680] = {name = "대지의 길", additional_info = "즉시\n[q]주무기에 대지의 무기가 활성화되어 있을 경우 위협 수준이 50%만큼, 생명력이 30%만큼 증가합니다. 받는 피해는 10%만큼, 근접 공격 치명타에 적중당할 확률도 6%만큼 감소합니다. 또한 대지 충격 시전 시 대상을 도발해 자신을 공격하게 하고 다른 충격 주문과 재사용 대기시간이 분리됩니다."},
