[409520] = {name = "냉기의 덫", additional_info = "마나 60 35 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]주위 지점에 30 sec 동안 유지되는 덫을 설치합니다. 10미터 반경 이내의 적은 가느다란 얼음실로 인해 덫의 반경 내에 있을 때 이동 속도가 60%만큼 감소합니다. 덫은 1 min 동안 지속됩니다. 덫은 동시에 한 개만 설치할 수 있습니다."},
[409521] = {name = "제물의 덫", additional_info = "마나 50 35 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]주위 지점에 덫을 설치합니다. 적이 다가오면 불태워 15 sec에 걸쳐 총 105의 화염 피해를 입힙니다. 덫은 1 min 동안 지속됩니다. 덫은 동시에 한 개만 설치할 수 있습니다."},
[409524] = {name = "제물의 덫", additional_info = "마나 90 35 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]주위 지점에 덫을 설치합니다. 적이 다가오면 불태워 15 sec에 걸쳐 총 215의 화염 피해를 입힙니다. 덫은 1 min 동안 지속됩니다. 덫은 동시에 한 개만 설치할 수 있습니다."},
[409526] = {name = "제물의 덫", additional_info = "마나 135 35 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]주위 지점에 덫을 설치합니다. 적이 다가오면 불태워 15 sec에 걸쳐 총 340의 화염 피해를 입힙니다. 덫은 1 min 동안 지속됩니다. 덫은 동시에 한 개만 설치할 수 있습니다."},
[409528] = {name = "제물의 덫", additional_info = "마나 190 35 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]주위 지점에 덫을 설치합니다. 적이 다가오면 불태워 15 sec에 걸쳐 총 510의 화염 피해를 입힙니다. 덫은 1 min 동안 지속됩니다. 덫은 동시에 한 개만 설치할 수 있습니다."},
[409530] = {name = "제물의 덫", additional_info = "마나 245 35 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]주위 지점에 덫을 설치합니다. 적이 다가오면 불태워 15 sec에 걸쳐 총 690의 화염 피해를 입힙니다. 덫은 1 min 동안 지속됩니다. 덫은 동시에 한 개만 설치할 수 있습니다."},
[409532] = {name = "폭발의 덫", additional_info = "마나 275 35 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]주위 지점에 덫을 설치합니다. 적이 다가오면 폭발하여 104 to 135의 화염 피해를 입히고 10미터 반경에 20 sec에 걸쳐 150의 추가 화염 피해를 입힙니다. 덫은 1 min 동안 지속됩니다. 덫은 동시에 한 개만 설치할 수 있습니다."},
[409534] = {name = "폭발의 덫", additional_info = "마나 395 35 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]주위 지점에 덫을 설치합니다. 적이 다가오면 폭발하여 145 to 193의 화염 피해를 입히고 10미터 반경에 20 sec에 걸쳐 240의 추가 화염 피해를 입힙니다. 덫은 1 min 동안 지속됩니다. 덫은 동시에 한 개만 설치할 수 있습니다."},
[409535] = {name = "폭발의 덫", additional_info = "마나 520 35 야드 사정거리\n즉시 15 초 재사용 대기시간\n[q]주위 지점에 덫을 설치합니다. 적이 다가오면 폭발하여 208 to 265의 화염 피해를 입히고 10미터 반경에 20 sec에 걸쳐 330의 추가 화염 피해를 입힙니다. 덫은 1 min 동안 지속됩니다. 덫은 동시에 한 개만 설치할 수 있습니다."},
[409541] = {name = "덫 발사", additional_info = "[q]덫을 35미터 반경 내 임의의 위치에 놓을 수 있습니다. 또한 전투 중에도 배치가 가능합니다. 화염 기반 덫과 냉기 기반 덫의 공유 재사용 대기시간이 분리됩니다."},
[409552] = {name = "폭발 사격", additional_info = "3.5% (기본 마나 중) 8 - 35 야드 사정거리\n6 초 재사용 대기시간\n원거리 무기 필요\n[q]폭발의 화살이나 탄환을 발사하여 8미터 내의 모든 적에게 [Ranged attack power * 0.039 + 41 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]~[Ranged attack power * 0.039 + 63 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]의 화염 피해를 입힙니다. 추가로 2 sec 동안 매초마다 다시 피해를 입힙니다."},
[409554] = {name = "폭발 사격", additional_info = "사정거리 없음\n[q]폭발의 화살이나 탄환을 발사하여 적 대상에게 (Ranged attack power * 0.14 + 10)-(Ranged attack power * 0.14 + 10)의 화염 피해를 입힙니다. 추가로 until cancelled 동안 매초마다 대상을 폭발하게 만듭니다. 신비한 사격과 재사용 대기시간을 공유합니다."},
[409580] = {name = "사자의 심장", additional_info = "8% (기본 마나 중)\n즉시\n[q]사냥꾼이 사자의 심장을 일깨웁니다. 주위 모든 아군의 총 능력치가 10%만큼, 사냥꾼의 총 능력치는 추가로 10%만큼 증가합니다."},
[409583] = {name = "사자의 심장", additional_info = "40 야드 사정거리\n즉시\n[q]사냥꾼이 사자의 심장을 일깨웁니다. 주위 모든 아군의 총 능력치가 10%만큼, 사냥꾼의 총 능력치는 추가로 10%만큼 증가합니다."},
[409687] = {name = "쌍수 무기 전문화", additional_info = "[q]보조 무기의 공격력이 50%만큼 증가합니다. 또한 쌍수 무기 사용 시 랩터의 일격이 두 무기를 모두 사용하여 적중합니다."},
[409691] = {name = "랩터의 일격", additional_info = "근접 사정거리\n즉시\n근접 무기 필요\n[q]적을 강하게 내리쳐 2 to 3의 추가 피해를 입힙니다."},
[409693] = {name = "랩터의 일격", additional_info = "근접 사정거리\n즉시\n근접 무기 필요\n[q]적을 강하게 내리쳐 5의 추가 피해를 입힙니다."},
[409748] = {name = "랩터의 일격", additional_info = "근접 사정거리\n즉시\n근접 무기 필요\n[q]적을 강하게 내리쳐 10 to 11의 추가 피해를 입힙니다."},
[409750] = {name = "랩터의 일격", additional_info = "근접 사정거리\n즉시\n근접 무기 필요\n[q]적을 강하게 내리쳐 17의 추가 피해를 입힙니다."},
[409751] = {name = "랩터의 일격", additional_info = "근접 사정거리\n즉시\n근접 무기 필요\n[q]적을 강하게 내리쳐 25의 추가 피해를 입힙니다."},
[409752] = {name = "랩터의 일격", additional_info = "근접 사정거리\n즉시\n근접 무기 필요\n[q]적을 강하게 내리쳐 40의 추가 피해를 입힙니다."},
[409754] = {name = "랩터의 일격", additional_info = "근접 사정거리\n즉시\n근접 무기 필요\n[q]적을 강하게 내리쳐 55의 추가 피해를 입힙니다."},
[409755] = {name = "랩터의 일격", additional_info = "근접 사정거리\n즉시\n근접 무기 필요\n[q]적을 강하게 내리쳐 70의 추가 피해를 입힙니다."},
[409805] = {name = "야생의 강타", additional_info = "[q]야생의 강타 능력을 얻습니다.\n\n\n표범 변신, 곰 변신 또는 광포한 곰 변신 상태일 때 20미터 내 파티원이 좀 더 매섭게 전투를 수행합니다. 근접 공격이 적중할 때마다 20%으 확률로 공격자가 재차 공격을 가해 전투력의 20%에 해당하는 추가 피해를 입힙니다. 파티원이 이미 질풍의 토템의 효과를 받는 경우 효과를 발휘하지 않습니다."},
[409809] = {name = "생존 본능", additional_info = "[q]생존 본능 능력을 얻습니다.\n\n\n활성화 시 20 sec 동안 최대 생명력의 30%만큼 생명력이 증가합니다. 이 효과가 만료되면 임시 생명력은 사라집니다. 모든 변신 상태에서 사용할 수 있습니다.\n\n 추가로 곰 변신 또는 광포한 곰 변신 상태로 회피할 때마다 5의 분노를 생성합니다. 표범 변신 상태로 회피할 때는 10의 기력을 회복하며, 그 외의 변신 상태일 때는 최대 마나의 1%를 회복합니다."},
[409810] = {name = "급속 성장", additional_info = "[q]급속 성장 능력을 얻습니다.\n\n\n7 sec에 걸쳐 대상 플레이어의 40미터 내에 있는 모든 파티원의 생명력을 [34 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]만큼 회복시킵니다. 처음엔 생명력을 빠르게 회복시키다가 시간이 지날수록 점점 느려집니다."},
[409813] = {name = "일월식", additional_info = "[q]일월식 능력을 얻습니다.\n\n\n별빛 화살이 다음 2회 동안 시전하는 천벌의 치명타 및 극대화율을 30%만큼 증가시킵니다. 또한 천벌은 다음 별빛 화살의 시전 시간을 1.0초만큼 감소시킵니다. 두 효과는 최대 4번까지 중첩됩니다. 두 주문을 시전할 때 피해를 받을 경우 70%의 확률로 시전 시간을 잃지 않습니다."},
[409819] = {name = "야생의 포효", additional_info = "[q]야생의 포효 능력을 얻습니다.\n\n\n마무리 일격을 날려 물리 공격력을 30%만큼 증가시킵니다. 표범 변신 상태일 때 사용할 수 있습니다. 연계 점수 당 다음 시간 동안 지속됩니다.\n 연계 점수 1점: 14초\n 연계 점수 2점: 19초\n 연계 점수 3점: 24초\n 연계 점수 4점: 29초\n 연계 점수 5점: 34초"},
[409824] = {name = "피어나는 생명", additional_info = "[q]회복 및 피어나는 생명의 전역 재사용 대기시간이 0.5초만큼 감소하고 피어나는 생명 능력을 얻습니다.\n\n\n 7 sec에 걸쳐 대상의 생명력을 [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]만큼 회복시킵니다. 피어나는 생명의 지속시간이 다하거나 무효화되면 대상은 그 즉시 [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]의 생명력을 회복하고 드루이드는 주문 시전에 소모한 자원의 절반을 회복합니다. 이 효과는 같은 대상에 대해 3번까지 중복될 수 있습니다."},
[409826] = {name = "자연의 격노", additional_info = "[q]자연의 격노 능력을 얻습니다.\n\n\n30 sec 동안 치유력이 자연 주문 공격력의 90%만큼 증가합니다."},
[409828] = {name = "짓이기기", additional_info = "[q]짓이기기 (곰) 능력을 얻고 할퀴기 능력을 짓이기기 (표범)으로 대체합니다. 이 능력은 할퀴기 및 후려치기와 관련된 모든 이로운 효과를 적용 및 발동시킵니다.\n\n\n대상을 짓이겨 일반 공격력의 160%에 해당하는 피해를 입히고 1 min 동안 출혈 효과 및 칼날 발톱으로 받는 피해를 30%만큼 추가로 증가시킵니다. 이 능력은 할퀴기 및 후려치기와 관련된 모든 이로운 효과를 적용 및 발동시킵니다.\n\n\n대상을 짓이겨 일반 공격력의 270%에 해당하는 피해를 입히고 1 min 동안 출혈 효과 및 칼날 발톱으로 받는 피해를 30%만큼 추가로 증가시킵니다. 연계 점수 1점을 생성합니다. 이 능력은 할퀴기 및 후려치기와 관련된 모든 이로운 효과를 적용 및 발동시킵니다."},
[409830] = {name = "육성", additional_info = "[q]육성 능력을 얻습니다.\n\n\n아군 대상의 생명력을 [161 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]에서 [189 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]만큼 회복시킵니다. 회복, 재생, 피어나는 생명, 급속 성장 효과가 걸려 있는 대상은 회복되는 생명력이 20%만큼 증가합니다. 이 주문은 치유의 손길과 관련된 모든 이로운 효과를 적용 및 발동시킵니다."},
[409831] = {name = "꿈결", additional_info = "[q]꿈결 능력을 얻습니다.\n\n\n공격 주문이 치명타 및 극대화 효과를 발휘하면 8 sec 동안 주문을 시전할 때 마나 회복 속도가 50%만큼, 12 sec 동안 대상에게 입히는 자연 피해가 20%만큼 증가합니다."},
[409832] = {name = "스톰레이지의 격노", additional_info = "[q]스톰레이지의 격노 능력을 얻습니다.\n\n\n 천벌의 마나 소모량이 100%만큼 감소합니다. 천벌로 피해를 입힐 때마다 12%의 확률로 다음 15 sec 동안 시전하는 치유의 손길이 변신 상태에 상관없이 즉시 시전됩니다."},
[409856] = {name = "영혼의 의식", additional_info = "30 야드 사정거리\n집중 (10 분 주문 시전 시간)\n[q]쓰러진 모험가의 영혼을 해방하는 의식을 시작합니다."},
[409858] = {name = "Dummy Trigger", additional_info = nil},
[409906] = {name = "빛의 봉화", additional_info = "[q]빛의 봉화 능력을 얻습니다.\n\n\n대상은 40미터 반경 내에 있는 모든 파티원과 공격대원에게 빛의 봉화가 됩니다. 해당 범위 내에 있는 파티원 또는 공격대원에게 시전하는 자신의 치유 주문은 회복시킨 생명력의 100%만큼 봉화가 된 대상의 생명력을 회복시킵니다. 동시에 오직 하나의 대상만 빛의 봉화가 될 수 있습니다. 1 min 동안 지속됩니다."},
[409911] = {name = "심판의 손길", additional_info = "[q]심판의 손길 능력을 얻습니다.\n\n\n적을 도발하여 자신을 공격하도록 만듭니다. 이미 자신을 공격하고 있다면 아무런 효과를 발휘하지 못합니다.\n\n 이 능력을 배웠다면 정의의 격노의 위협 수준 증가량이 80%로 증가합니다. 또한 정의의 격노가 받는 치유 효과의 25%만큼 마나를 회복시킵니다. 추가로 정의의 격노가 활성화된 동안 생명력이 35% 미만으로 떨어질 수 있는 공격을 받으면 그 공격으로 받는 피해가 20%만큼 감소합니다. 취소할 때까지 정의의 격노가 지속됩니다."},
[409914] = {name = "성전사의 일격", additional_info = "[q]성전사의 일격 능력을 얻습니다.\n\n\n 적에게 즉시 일격을 가하여 무기 공격력의 75%에 해당하는 신성 피해를 입히고 최대 마나의 5%를 회복합니다."},
[409918] = {name = "영감 (심판)", additional_info = nil},
[409920] = {name = "유물 배우기 (심판)", additional_info = nil},
[409922] = {name = "정의의 망치", additional_info = "[q]정의의 망치 능력을 얻습니다.\n\n\n대상과 주위 최대 2명의 대상에게 주장비 초당 공격력의 4배에 해당하는 신성 피해를 입힙니다."},
[409924] = {name = "천상의 폭풍", additional_info = "[q]천상의 폭풍 능력을 얻습니다.\n\n\n 즉시 무기로 공격하여 8미터 반경 내에 있는 최대 4명의 적에게 무기 공격력의 110%에 해당하는 피해를 입힙니다. 또한 입힌 피해의 최대 25%만큼 최대 3명의 파티원 혹은 공격대원의 생명력을 회복시킵니다."},
[409925] = {name = "헌신의 문장", additional_info = nil},
[409930] = {name = "심판의 성서", additional_info = nil},
[409933] = {name = "응징의 방패", additional_info = "[q]응징의 방패 능력을 얻습니다.\n\n\n적에게 신성한 방패를 날려 [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power]에서 [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power]의 신성 피해를 입히고 멍해지도록 만듭니다. 주위 적을 연쇄적으로 가격하며 최대 3명의 대상을 공격합니다. 10 sec 동안 지속됩니다."},
[409935] = {name = "성스러운 희생", additional_info = "[q]성스러운 희생 능력을 얻습니다.\n\n\n10 sec 동안 30미터 반경 내에 있는 파티원이 받는 모든 피해의 30%에 해당하는 피해를 자신에게 이전시킵니다. 성기사의 생명력이 20% 미만으로 감소하는 피해를 입으면 효과가 해제되고 10 sec 동안 공격력과 치유량이 10%만큼 증가합니다. 보호의 축복, 천상의 보호막, 신의 가호 효과를 받는 동안에는 성스러운 희생을 사용할 수 없으며, 추가로 성스러운 희생이 활성화된 동안에는 해당 능력의 대상으로 지정하지 못합니다."},
[409936] = {name = "영감의 모범", additional_info = "[q]영감의 모범\n 능력을 얻습니다.\n\n\n고무적인 존재감이 주기적으로 주위 파티원의 공포 및 수면 효과를 무효화합니다."},
[409938] = {name = "불꽃 회오리", additional_info = "[q]불꽃 회오리 능력이 불꽃 회오리 토템을 대체합니다.\n\n\n불꽃 회오리 토템 주문이 불꽃 회오리로 대체됩니다. 불꽃 회오리 시전 시 현재 활성화된 불의 토템이 자신의 위치에 피해를 발산합니다."},
[409940] = {name = "쌍수 무기 전문화", additional_info = "[q]쌍수 무기 전문화 능력을 얻습니다.\n\n\n쌍수 무기 사용 시 주문 및 근접 공격이 적중할 확률이 10%만큼 증가합니다. 쌍수 무기를 사용하는 동안에는 폭풍의 일격이 두 무기로 적중합니다. 또한 보조 무기의 공격력이 50%만큼 증가합니다."},
[409941] = {name = "물의 보호막", additional_info = "[q]물의 보호막 능력을 얻습니다.\n\n\n3개의 물방울이 시전자의 주위에 머무르며 5초마다 최대 마나의 1%를 회복합니다. 만약 시전자가 주문이나 근접 또는 원거리 공격에 적중 당하면 시전자는 물방울로부터 최대 마나의 4%를 흡수합니다. 매번 마나를 흡수할 때마다 물방울이 하나씩 사라집니다. 물방울이 하나 사라지면 다른 물방울이 효력을 발휘하기까지 일정 시간이 필요합니다. 10 min 동안 지속됩니다. 주술사의 보호막은 동시에 하나만 유지할 수 있습니다."},
[409943] = {name = "방패 숙련", additional_info = "[q]방패 숙련 능력을 얻습니다.\n\n\n방패 막기에 성공할 때마다 최대 마나의 8%에 해당하는 마나를 회복하고 방어도가 방패 방어도의 30%만큼 증가합니다. 최대 5번까지 중첩됩니다. 또한 항상 방패 막기 확률이 10%만큼, 방패 막기 수치가 15%만큼 증가합니다."},
[409944] = {name = "고대의 인도", additional_info = "[q]고대의 인도 능력을 얻습니다.\n\n\n다음 10 sec 동안 입히는 피해의 25%가 치유량으로 전환되어 주위에 있는 최대 3명의 파티원을 치유합니다. 또한 치유량의 100%는 피해량으로 전환되어 가장 최근 화염 충격을 시전한 대상에게 피해를 입힙니다."},
[409945] = {name = "과부하", additional_info = "[q]과부하 능력을 얻습니다.\n\n\n번개 화살, 연쇄 번개, 연쇄 치유, 치유의 물결, 용암 폭발 주문 시전 시 50%의 확률로 마나 소비 없이 같은 대상에게 유사한 주문을 시전하여 절반의 피해를 입히거나 생명력을 회복시킵니다. 이 주문은 위협 수준을 생성하지 않습니다."},
[409946] = {name = "소용돌이치는 무기", additional_info = "[q]소용돌이치는 무기 능력을 얻습니다.\n\n\n근접 공격으로 피해를 입히면 일정 확률로 다음 번개 화살, 연쇄 번개, 하급 치유의 물결, 치유의 물결, 연쇄 치유 또는 용암 폭발 주문의 시전 시간과 마나 소모량이 20%만큼 감소합니다. 주 무기에 질풍의 무기가 부여되어 있다면 발동 확률이 50%만큼 증가합니다. 5번까지 중복됩니다. 30 sec 동안 지속됩니다."},
[409947] = {name = "대지의 보호막", additional_info = "[q]대지의 보호막 능력을 얻습니다.\n\n\n대상을 대지의 보호막으로 감싸 피해를 입을 시 정신 집중이나 주문 시전이 지연되는 시간이 30%만큼 감소하게 하고 보호막이 걸린 대상이 공격을 받을 시 [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100]의 생명력을 회복하도록 합니다. 이 효과는 몇초마다 한 번씩만 발휘됩니다. 9회 사용 가능하며 10 min 동안 지속됩니다. 대지의 보호막은 동시에 한 대상에게만 걸 수 있으며 주술사의 보호막은 대상마다 동시에 하나만 효과를 발휘할 수 있습니다."},
[409951] = {name = "우두머리의 영혼", additional_info = "[q]우두머리의 영혼 능력을 얻습니다.\n\n\n대상에게 늑대 우두머리의 영혼을 주입하여 30 min 동안 생성되는 모든 위협 수준을 45%만큼 증가시킵니다. 한 번에 하나의 대상에만 영향을 줍니다. 자신이 아닌 다른 대상에게 시전하면 주술사는 충직한 수하 효과를 얻어 30 min 동안 물리 공격력이 5%만큼 증가하고 모든 위협 생성 수준이 30%만큼 감소합니다. 우두머리의 영혼과 충직한 수하 효과를 동시에 보유하는 것은 불가능합니다."},
[409952] = {name = "용암 폭발", additional_info = "[q]용암 폭발 능력을 얻습니다.\n\n\n대상에게 녹아내리는 용암을 날려 [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)]에서 [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)]의 화염 피해를 입힙니다. 대상에 화염 충격 효과가 걸려 있으면 치명타로 적중합니다."},
[409953] = {name = "용암 채찍", additional_info = "[q]용암 채찍 능력을 얻습니다.\n\n\n 보조 무기에 용암의 열기를 주입하여 즉시 보조 무기 공격력의 100%에 해당하는 피해를 입힙니다. 보조 무기에 불꽃의 무기 효과가 활성화되어 있으면 피해가 125%만큼 증가합니다."},
[409954] = {name = "성난 해일", additional_info = "[q]성난 해일 능력을 얻습니다.\n\n\n아군 대상의 생명력을 [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]에서 [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]만큼 회복시키고 15 sec에 걸쳐 [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]의 생명력을 회복시킵니다. 15 sec 내에 대상에게 시전하는 다음 연쇄 치유 주문은 지속적인 치유 효과를 흡수하여 연쇄 치유의 치유 효과를 25%만큼 증가시킵니다. 또한 이 주문은 고대의 각성을 발동시킵니다."},
[409955] = {name = "대지의 길", additional_info = "[q]대지의 길 능력을 얻습니다.\n\n\n주무기에 대지의 무기가 활성화되어 있고 방패를 장착 중일 경우 위협 수준이 50%만큼, 생명력이 30%만큼 증가합니다. 받는 피해는 10%만큼, 근접 공격 치명타에 적중당할 확률도 6%만큼 감소합니다. 또한 대지 충격 시전 시 대상을 도발해 자신을 공격하게 하고 다른 충격 주문과 재사용 대기시간이 분리됩니다. 사정거리가 근접 공격 범위로 감소합니다."},
[409957] = {name = "고정 사격", additional_info = "[q]고정 사격 능력을 얻습니다.\n\n\n안정적인 사격으로 원거리 무기 공격력의 75%에 해당하는 피해를 입힙니다."},
[409958] = {name = "사격의 명수", additional_info = "[q]사격의 명수 능력을 얻습니다.\n\n\n치명타 적중률이 5%만큼 증가하고 모든 사격 능력의 마나 소모량이 25%만큼 감소합니다."},
[409959] = {name = "결점 노출", additional_info = "[q]결점 노출 능력을 얻습니다.\n\n\n근접 및 원거리 공격이 치명타로 적중하면 7 sec 동안 전투력이 현재 민첩성의 40%만큼 증가합니다."},
[409960] = {name = "사자의 심장", additional_info = "[q]사자의 심장 능력을 얻습니다.\n\n\n사냥꾼이 사자의 심장을 일깨웁니다. 주위 모든 아군의 총 능력치가 10%만큼, 사냥꾼의 총 능력치는 추가로 10%만큼 증가합니다."},
[409961] = {name = "쌍수 무기 전문화", additional_info = "[q]쌍수 무기 전문가 능력을 얻습니다.\n\n\n보조 무기의 공격력이 50%만큼 증가합니다. 또한 쌍수 무기 사용 시 랩터의 일격이 두 무기를 모두 사용하여 적중합니다."},
[409962] = {name = "야수 숙련", additional_info = "[q]야수 숙련 능력을 얻습니다.\n\n\n야수의 공격력과 생명력이 20%만큼, 집중 회복 속도가 50%만큼 증가합니다. 추가로 야수의 포효가 대상을 도발하여 3 sec 동안 야수 자신을 공격하게 만듭니다."},
[409963] = {name = "영혼 소환", additional_info = nil},
[409968] = {name = "덫 발사", additional_info = "[q]덫 발사 능력을 얻습니다.\n\n\n덫을 35미터 반경 내 임의의 위치에 놓을 수 있습니다. 또한 전투 중에도 배치가 가능합니다. 화염 기반 덫과 냉기 기반 덫의 공유 재사용 대기시간이 분리됩니다."},
[409974] = {name = "살상 명령", additional_info = "[q]살상 명령 능력을 얻습니다.\n\n\n야수에게 살상 명령을 내려 30 sec 동안 할퀴기 및 물기로 입히는 피해를 60%만큼 증가시킵니다. 할퀴기 및 물기를 사용할 때마다 공격력 증가 효과가 20%만큼 감소합니다."},
[409976] = {name = "키메라 사격", additional_info = "[q]키메라 사격 능력을 얻습니다.\n\n\n 무기 공격력의 120%에 해당하는 피해를 입힌 후 대상에 걸려 있는 쐐기를 초기화하고 다음 효과를 발동시킵니다:\n\n 독사 쐐기 - 즉시 독사 쐐기 피해량의 48%에 해당하는 피해를 입힙니다.\n\n 살무사 쐐기 - 살무사 쐐기로 소진시킨 마나량의 60%에 해당하는 마나를 즉시 돌려받습니다.\n\n 전갈 쐐기 - 대상에게 10 sec 동안 무장 해제를 시도합니다. 이 효과는 1분마다 1번씩만 발동됩니다."},
[409978] = {name = "폭발 사격", additional_info = "[q]폭발 사격 능력을 얻습니다.\n\n\n폭발의 화살이나 탄환을 발사하여 8미터 내의 모든 적에게 [Ranged attack power * 0.039 + 41 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]~[Ranged attack power * 0.039 + 63 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]의 화염 피해를 입힙니다. 추가로 2 sec 동안 매초마다 다시 피해를 입힙니다."},
[409979] = {name = "고독한 늑대", additional_info = "[q]고독한 늑대 능력을 얻습니다.\n\n\n활성화된 야수가 없을 때 모든 공격의 공격력이 30%만큼 증가합니다."},
[409988] = {name = "플레이어 강제 시전 지연된 추방", additional_info = nil},
[409999] = {name = "장갑 각인술 - 빛의 봉화", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 빛의 봉화 룬을 새깁니다.\n\n\n대상은 40미터 반경 내에 있는 모든 파티원과 공격대원에게 빛의 봉화가 됩니다. 해당 범위 내에 있는 파티원 또는 공격대원에게 시전하는 자신의 치유 주문은 회복시킨 생명력의 100%만큼 봉화가 된 대상의 생명력을 회복시킵니다. 동시에 오직 하나의 대상만 빛의 봉화가 될 수 있습니다. 1 min 동안 지속됩니다."},
[410001] = {name = "장갑 각인술 - 집행의 손길", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 집행의 손길 룬을 새깁니다.\n\n\n적을 도발하여 자신을 공격하도록 만듭니다. 이미 자신을 공격하고 있다면 아무런 효과를 발휘하지 못합니다.\n\n 이 능력을 배웠다면 정의의 격노의 위협 수준 증가량이 80%로 증가합니다. 또한 정의의 격노가 받는 치유 효과의 25%만큼 마나를 회복시킵니다. 추가로 정의의 격노가 활성화된 동안 생명력이 35% 미만으로 떨어질 수 있는 공격을 받으면 그 공격으로 받는 피해가 20%만큼 감소합니다. 취소할 때까지 정의의 격노가 지속됩니다."},
[410002] = {name = "장갑 각인술 - 성전사의 일격", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 성전사의 일격 룬을 새깁니다.\n\n\n 적에게 즉시 일격을 가하여 무기 공격력의 75%에 해당하는 신성 피해를 입히고 최대 마나의 5%를 회복합니다."},
[410008] = {name = "바지 각인술 - 응징의 방패", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 응징의 방패 룬을 새깁니다.\n\n\n적에게 신성한 방패를 날려 [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power]에서 [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power]의 신성 피해를 입히고 멍해지도록 만듭니다. 주위 적을 연쇄적으로 가격하며 최대 3명의 대상을 공격합니다. 10 sec 동안 지속됩니다."},
[410010] = {name = "바지 각인술 - 성스러운 희생", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 성스러운 희생 룬을 새깁니다.\n\n\n10 sec 동안 30미터 반경 내에 있는 파티원이 받는 모든 피해의 30%에 해당하는 피해를 자신에게 이전시킵니다. 성기사의 생명력이 20% 미만으로 감소하는 피해를 입으면 효과가 해제되고 10 sec 동안 공격력과 치유량이 10%만큼 증가합니다. 보호의 축복, 천상의 보호막, 신의 가호 효과를 받는 동안에는 성스러운 희생을 사용할 수 없으며, 추가로 성스러운 희생이 활성화된 동안에는 해당 능력의 대상으로 지정하지 못합니다."},
[410011] = {name = "바지 각인술 - 영감의 모범", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 영감의 모범 룬을 새깁니다.\n\n\n고무적인 존재감이 주기적으로 주위 파티원의 공포 및 수면 효과를 무효화합니다."},
[410013] = {name = "팔보호구 각인술 - 정의의 망치", additional_info = "3 초 주문 시전 시간\n손목보호구 필요\n[q]팔보호구에 정의의 망치 룬을 새깁니다.\n\n\n대상과 주위 최대 2명의 대상에게 주장비 초당 공격력의 4배에 해당하는 신성 피해를 입힙니다."},
[410014] = {name = "가슴보호구 각인술 - 천상의 폭풍", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구에 천상의 폭풍 룬을 새깁니다.\n\n\n 즉시 무기로 공격하여 8미터 반경 내에 있는 최대 4명의 적에게 무기 공격력의 110%에 해당하는 피해를 입힙니다. 또한 입힌 피해의 최대 25%만큼 최대 3명의 파티원 혹은 공격대원의 생명력을 회복시킵니다."},
[410015] = {name = "가슴보호구 각인술 - 헌신의 문장", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요"},
[410021] = {name = "가슴보호구 각인술 - 야생의 강타", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 야생의 강타 룬을 새깁니다.\n\n\n표범 변신, 곰 변신 또는 광포한 곰 변신 상태일 때 20미터 내 파티원이 좀 더 매섭게 전투를 수행합니다. 근접 공격이 적중할 때마다 20%으 확률로 공격자가 재차 공격을 가해 전투력의 20%에 해당하는 추가 피해를 입힙니다. 파티원이 이미 질풍의 토템의 효과를 받는 경우 효과를 발휘하지 않습니다."},
[410023] = {name = "바지 각인술 - 야생의 포효", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 야생의 포효 룬을 새깁니다.\n\n\n마무리 일격을 날려 물리 공격력을 30%만큼 증가시킵니다. 표범 변신 상태일 때 사용할 수 있습니다. 연계 점수 당 다음 시간 동안 지속됩니다.\n 연계 점수 1점: 14초\n 연계 점수 2점: 19초\n 연계 점수 3점: 24초\n 연계 점수 4점: 29초\n 연계 점수 5점: 34초"},
[410025] = {name = "장갑 각인술 - 짓이기기", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 짓이기기 룬을 새깁니다.\n\n\n대상을 짓이겨 일반 공격력의 160%에 해당하는 피해를 입히고 1 min 동안 출혈 효과 및 칼날 발톱으로 받는 피해를 30%만큼 추가로 증가시킵니다. 이 능력은 할퀴기 및 후려치기와 관련된 모든 이로운 효과를 적용 및 발동시킵니다."},
[410027] = {name = "장화 각인술 - 생존 본능", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 생존 본능 룬을 새깁니다.\n\n\n활성화 시 20 sec 동안 최대 생명력의 30%만큼 생명력이 증가합니다. 이 효과가 만료되면 임시 생명력은 사라집니다. 모든 변신 상태에서 사용할 수 있습니다.\n\n 추가로 곰 변신 또는 광포한 곰 변신 상태로 회피할 때마다 5의 분노를 생성합니다. 표범 변신 상태로 회피할 때는 10의 기력을 회복하며, 그 외의 변신 상태일 때는 최대 마나의 1%를 회복합니다."},
[410028] = {name = "장갑 각인술 - 거친 눈썹", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 급속 성장 룬을 새깁니다.\n\n\n7 sec에 걸쳐 대상 플레이어의 40미터 내에 있는 모든 파티원의 생명력을 [34 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]만큼 회복시킵니다. 처음엔 생명력을 빠르게 회복시키다가 시간이 지날수록 점점 느려집니다."},
[410029] = {name = "허리띠 각인술 - 일월식", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 일월식 룬을 새깁니다.\n\n\n별빛 화살이 다음 2회 동안 시전하는 천벌의 치명타 및 극대화율을 30%만큼 증가시킵니다. 또한 천벌은 다음 별빛 화살의 시전 시간을 1.0초만큼 감소시킵니다. 두 효과는 최대 4번까지 중첩됩니다. 두 주문을 시전할 때 피해를 받을 경우 70%의 확률로 시전 시간을 잃지 않습니다."},
[410033] = {name = "바지 각인술 - 피어나는 생명", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 피어나는 생명 룬을 새깁니다.\n\n 회복 및 피어나는 생명의 전역 재사용 대기시간이 0.5초만큼 감소하고 피어나는 생명 능력을 얻습니다.\n\n\n 7 sec에 걸쳐 대상의 생명력을 [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]만큼 회복시킵니다. 피어나는 생명의 지속시간이 다하거나 무효화되면 대상은 그 즉시 [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]의 생명력을 회복하고 드루이드는 주문 시전에 소모한 자원의 절반을 회복합니다. 이 효과는 같은 대상에 대해 3번까지 중복될 수 있습니다."},
[410059] = {name = "허리띠 각인술 - 육성", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 육성 룬을 새깁니다.\n\n\n아군 대상의 생명력을 [161 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]에서 [189 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)]만큼 회복시킵니다. 회복, 재생, 피어나는 생명, 급속 성장 효과가 걸려 있는 대상은 회복되는 생명력이 20%만큼 증가합니다. 이 주문은 치유의 손길과 관련된 모든 이로운 효과를 적용 및 발동시킵니다."},
[410060] = {name = "장화 각인술 - 꿈결", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 꿈결 룬을 새깁니다.\n\n\n공격 주문이 치명타 및 극대화 효과를 발휘하면 8 sec 동안 주문을 시전할 때 마나 회복 속도가 50%만큼, 12 sec 동안 대상에게 입히는 자연 피해가 20%만큼 증가합니다."},
[410061] = {name = "가슴보호구 각인술 - 스톰레이지의 분노", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 스톰레이지의 격노 룬을 새깁니다.\n\n\n 천벌의 마나 소모량이 100%만큼 감소합니다. 천벌로 피해를 입힐 때마다 12%의 확률로 다음 15 sec 동안 시전하는 치유의 손길이 변신 상태에 상관없이 즉시 시전됩니다."},
[410093] = {name = "허리띠 각인술 - 불꽃 회오리", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 불꽃 회오리 룬을 새깁니다.\n\n\n불꽃 회오리 토템 주문이 불꽃 회오리로 대체됩니다. 불꽃 회오리 시전 시 현재 활성화된 불의 토템이 자신의 위치에 피해를 발산합니다."},
[410094] = {name = "가슴보호구 각인술 - 과부하", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 과부하 룬을 새깁니다.\n\n\n번개 화살, 연쇄 번개, 연쇄 치유, 치유의 물결, 용암 폭발 주문 시전 시 50%의 확률로 마나 소비 없이 같은 대상에게 유사한 주문을 시전하여 절반의 피해를 입히거나 생명력을 회복시킵니다. 이 주문은 위협 수준을 생성하지 않습니다."},
[410095] = {name = "장갑 각인술 - 용암 폭발", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 용암 폭발 룬을 새깁니다.\n\n\n대상에게 녹아내리는 용암을 날려 [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)]에서 [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)]의 화염 피해를 입힙니다. 대상에 화염 충격 효과가 걸려 있으면 치명타로 적중합니다."},
[410096] = {name = "가슴보호구 각인술 - 쌍수 무기 전문화", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 쌍수 무기 전문화 룬을 새깁니다.\n\n\n쌍수 무기 사용 시 주문 및 근접 공격이 적중할 확률이 10%만큼 증가합니다. 쌍수 무기를 사용하는 동안에는 폭풍의 일격이 두 무기로 적중합니다. 또한 보조 무기의 공격력이 50%만큼 증가합니다."},
[410097] = {name = "장갑 각인술 - 물의 보호막", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 물의 보호막 룬을 새깁니다.\n\n\n3개의 물방울이 시전자의 주위에 머무르며 5초마다 최대 마나의 1%를 회복합니다. 만약 시전자가 주문이나 근접 또는 원거리 공격에 적중 당하면 시전자는 물방울로부터 최대 마나의 4%를 흡수합니다. 매번 마나를 흡수할 때마다 물방울이 하나씩 사라집니다. 물방울이 하나 사라지면 다른 물방울이 효력을 발휘하기까지 일정 시간이 필요합니다. 10 min 동안 지속됩니다. 주술사의 보호막은 동시에 하나만 유지할 수 있습니다."},
[410098] = {name = "가슴보호구 각인술 - 방패 숙련", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 방패 숙련 룬을 새깁니다.\n\n\n방패 막기에 성공할 때마다 최대 마나의 8%에 해당하는 마나를 회복하고 방어도가 방패 방어도의 30%만큼 증가합니다. 최대 5번까지 중첩됩니다. 또한 항상 방패 막기 확률이 10%만큼, 방패 막기 수치가 15%만큼 증가합니다."},
[410099] = {name = "바지 각인술 - 고대의 인도", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 고대의 인도 룬을 새깁니다.\n\n\n다음 10 sec 동안 입히는 피해의 25%가 치유량으로 전환되어 주위에 있는 최대 3명의 파티원을 치유합니다. 또한 치유량의 100%는 피해량으로 전환되어 가장 최근 화염 충격을 시전한 대상에게 피해를 입힙니다."},
[410100] = {name = "허리띠 각인술 - 소용돌이치는 무기", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 소용돌이치는 무기 룬을 새깁니다.\n\n\n근접 공격으로 피해를 입히면 일정 확률로 다음 번개 화살, 연쇄 번개, 하급 치유의 물결, 치유의 물결, 연쇄 치유 또는 용암 폭발 주문의 시전 시간과 마나 소모량이 20%만큼 감소합니다. 주 무기에 질풍의 무기가 부여되어 있다면 발동 확률이 50%만큼 증가합니다. 5번까지 중복됩니다. 30 sec 동안 지속됩니다."},
[410101] = {name = "바지 각인술 - 대지의 보호막", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 대지의 보호막 룬을 새깁니다.\n\n\n대상을 대지의 보호막으로 감싸 피해를 입을 시 정신 집중이나 주문 시전이 지연되는 시간이 30%만큼 감소하게 하고 보호막이 걸린 대상이 공격을 받을 시 [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100]의 생명력을 회복하도록 합니다. 이 효과는 몇초마다 한 번씩만 발휘됩니다. 9회 사용 가능하며 10 min 동안 지속됩니다. 대지의 보호막은 동시에 한 대상에게만 걸 수 있으며 주술사의 보호막은 대상마다 동시에 하나만 효과를 발휘할 수 있습니다."},
[410103] = {name = "장화 각인술 - 우두머리의 영혼", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 우두머리의 영혼 룬을 새깁니다.\n\n\n대상에게 늑대 우두머리의 영혼을 주입하여 30 min 동안 생성되는 모든 위협 수준을 45%만큼 증가시킵니다. 한 번에 하나의 대상에만 영향을 줍니다. 자신이 아닌 다른 대상에게 시전하면 주술사는 충직한 수하 효과를 얻어 30 min 동안 물리 공격력이 5%만큼 증가하고 모든 위협 생성 수준이 30%만큼 감소합니다. 우두머리의 영혼과 충직한 수하 효과를 동시에 보유하는 것은 불가능합니다."},
[410104] = {name = "장갑 각인술 - 용암 채찍", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 용암 채찍 룬을 새깁니다.\n\n\n 보조 무기에 용암의 열기를 주입하여 즉시 보조 무기 공격력의 100%에 해당하는 피해를 입힙니다. 보조 무기에 불꽃의 무기 효과가 활성화되어 있으면 피해가 125%만큼 증가합니다."},
[410105] = {name = "팔보호구 각인술 - 성난 해일", additional_info = "3 초 주문 시전 시간\n손목보호구 필요\n[q]팔보호구에 성난 해일 룬을 새깁니다.\n\n\n아군 대상의 생명력을 [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]에서 [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]만큼 회복시키고 15 sec에 걸쳐 [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]의 생명력을 회복시킵니다. 15 sec 내에 대상에게 시전하는 다음 연쇄 치유 주문은 지속적인 치유 효과를 흡수하여 연쇄 치유의 치유 효과를 25%만큼 증가시킵니다. 또한 이 주문은 고대의 각성을 발동시킵니다."},
[410107] = {name = "바지 각인술 - 대지의 길", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 대지의 길 룬을 새깁니다.\n\n\n주무기에 대지의 무기가 활성화되어 있고 방패를 장착 중일 경우 위협 수준이 50%만큼, 생명력이 30%만큼 증가합니다. 받는 피해는 10%만큼, 근접 공격 치명타에 적중당할 확률도 6%만큼 감소합니다. 또한 대지 충격 시전 시 대상을 도발해 자신을 공격하게 하고 다른 충격 주문과 재사용 대기시간이 분리됩니다. 사정거리가 근접 공격 범위로 감소합니다."},
[410109] = {name = "허리띠 각인술 - 고정 사격", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 고정 사격 룬을 새깁니다.\n\n\n안정적인 사격으로 원거리 무기 공격력의 75%에 해당하는 피해를 입힙니다."},
[410110] = {name = "장갑 각인술 - 야수 숙련", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 야수 숙련 룬을 새깁니다.\n\n\n야수의 공격력과 생명력이 20%만큼, 집중 회복 속도가 50%만큼 증가합니다. 추가로 야수의 포효가 대상을 도발하여 3 sec 동안 야수 자신을 공격하게 만듭니다."},
[410111] = {name = "바지 각인술 - 살상 명령", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 살상 명령 룬을 새깁니다.\n\n\n야수에게 살상 명령을 내려 30 sec 동안 할퀴기 및 물기로 입히는 피해를 60%만큼 증가시킵니다. 할퀴기 및 물기를 사용할 때마다 공격력 증가 효과가 20%만큼 감소합니다."},
[410113] = {name = "가슴보호구 각인술 - 사격의 명수", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 사격의 명수 룬을 새깁니다.\n\n\n치명타 적중률이 5%만큼 증가하고 모든 사격 능력의 마나 소모량이 25%만큼 감소합니다."},
[410114] = {name = "허리띠 각인술 - 결점 노출", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 결점 노출 룬을 새깁니다.\n\n\n근접 및 원거리 공격이 치명타로 적중하면 7 sec 동안 전투력이 현재 민첩성의 40%만큼 증가합니다."},
[410115] = {name = "가슴보호구 각인술 - 사자의 심장", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 사자의 심장 룬을 새깁니다.\n\n\n사냥꾼이 사자의 심장을 일깨웁니다. 주위 모든 아군의 총 능력치가 10%만큼, 사냥꾼의 총 능력치는 추가로 10%만큼 증가합니다."},
[410116] = {name = "장화 각인술 - 쌍수 무기 전문화", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 쌍수 무기 전문화 룬을 새깁니다.\n\n\n보조 무기의 공격력이 50%만큼 증가합니다. 또한 쌍수 무기 사용 시 랩터의 일격이 두 무기를 모두 사용하여 적중합니다."},
[410118] = {name = "장화 각인술 - 덫 발사", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 덫 발사 룬을 새깁니다.\n\n\n덫을 35미터 반경 내 임의의 위치에 놓을 수 있습니다. 또한 전투 중에도 배치가 가능합니다. 화염 기반 덫과 냉기 기반 덫의 공유 재사용 대기시간이 분리됩니다."},
[410121] = {name = "장갑 각인술 - 키메라 사격", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 키메라 사격 룬을 새깁니다.\n\n\n 무기 공격력의 120%에 해당하는 피해를 입힌 후 대상에 걸려 있는 쐐기를 초기화하고 다음 효과를 발동시킵니다:\n\n 독사 쐐기 - 즉시 독사 쐐기 피해량의 48%에 해당하는 피해를 입힙니다.\n\n 살무사 쐐기 - 살무사 쐐기로 소진시킨 마나량의 60%에 해당하는 마나를 즉시 돌려받습니다.\n\n 전갈 쐐기 - 대상에게 10 sec 동안 무장 해제를 시도합니다. 이 효과는 1분마다 1번씩만 발동됩니다."},
[410122] = {name = "가슴보호구 각인술 - 고독한 늑대", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 고독한 늑대 룬을 새깁니다.\n\n\n활성화된 야수가 없을 때 모든 공격의 공격력이 30%만큼 증가합니다."},
[410123] = {name = "장갑 각인술 - 폭발 사격", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 폭발 사격 룬을 새깁니다.\n\n\n폭발의 화살이나 탄환을 발사하여 8미터 내의 모든 적에게 [Ranged attack power * 0.039 + 41 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]~[Ranged attack power * 0.039 + 63 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]의 화염 피해를 입힙니다. 추가로 2 sec 동안 매초마다 다시 피해를 입힙니다."},
