[410156] = {name = "폭풍의 일격", additional_info = "사정거리 없음\n즉시\n[q]추가 공격을 가합니다. 다음 2회 동안 대상에게 입히는 자연 피해가 20%만큼 증가합니다. 12 sec 동안 지속됩니다."},
