[410176] = {name = "두개골 강타", additional_info = "기력 25 / 분노 10 13 야드 사정거리\n즉시 시전 10 초 재사용 대기시간\n표범 변신, 곰 변신, 광포한 곰 변신 필요\n[q]13미터 내의 대상에게 돌진한 후 두개골을 강타하여 주문 시전을 방해하고, 2 sec 동안 같은 계열의 주문을 시전하지 못하게 합니다. 야성의 돌진과 재사용 대기시간을 공유합니다."},
