[411624] = {name = "야수 길들이기", additional_info = "30 야드 사정거리\n즉시\n[q]야수를 길들여 친구로 만듭니다. 야수를 길들이는 데 집중하는 20 sec 동안은 방어도가 100%만큼 감소합니다. 만약 이 동안 어떤 이유로든 야수의 주의가 딴데로 돌아가게 된다면 길들이기는 실패합니다. 길들이는 데 성공하면 만족도와 충성도가 매우 낮습니다. 즉시 먹을 것을 줘서 만족도를 높이도록 하십시오."},
