[412018] = {name = "성스러운 보호막", additional_info = "사정거리 없음\n즉시\n[q]대상이 피해를 받을 때마다 36의 피해를 흡수하고 6 sec 동안 빛의 섬광 주문이 극대화 효과를 발휘할 확률을 50%만큼 증가시키는 성스러운 보호막 효과를 얻습니다. 이 효과는 최대 6초마다 한 번씩만 발동됩니다. 6 sec 동안 지속됩니다."},
[412019] = {name = "성스러운 보호막", additional_info = "12% (기본 마나 중) 40 야드 사정거리\n즉시\n[q]대상이 피해를 받을 때마다 [36 * (38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) / 100]의 피해를 흡수하고 최대 6 sec 동안 빛의 섬광 주문이 극대화 효과를 발휘할 확률을 50%만큼 증가시키는 성스러운 보호막 효과를 얻습니다. 추가로 빛의 섬광 시전 시 성스러운 보호막이 부여된 대상을 12 sec에 걸쳐 100%만큼 추가로 치유합니다. 이 효과는 최대 6초마다 한 번씩만 발동됩니다. 30 sec 동안 지속됩니다. 이 주문은 동시에 하나의 대상에만 사용할 수 있습니다."},
