[412510] = {name = "대규모 재생력", additional_info = "69% (기본 마나 중) 40 야드 사정거리\n집중 (3 초 주문 시전 시간) 6 초 재사용 대기시간\n[q]대상 플레이어의 30미터 반경 내에 있는 모든 파티원을 3 sec에 걸쳐 [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3]만큼 치유하고 각 대상에게 15초 동안 시간의 봉화를 부여합니다.\n\n 시간의 봉화\n\n대상의 시공간 위치를 기록합니다. 시전자가 입히는 모든 비전 피해의 80%가 시간의 치유로 전환되어 현재 시간의 봉화가 부여된 각 대상을 치유합니다. 대상이 자신일 경우 치유량이 50%만큼 감소합니다. 또한 여러 대상을 공격하는 비전 주문으로 피해를 입힐 경우에는 치유량이 80%만큼 감소합니다."},
