[415423] = {name = "독사의 상", additional_info = "즉시\n[q]사냥꾼이 독사의 상을 취합니다. 이 동안에는 원거리 및 근접 자동 공격 시 마나를 회복하지만 전체 공격력이 10%만큼 감소합니다. 추가로 사냥꾼은 매 3초마다 전체 마나의 10%에 해당하는 마나를 얻습니다. 무기의 공격 속도가 빠를 수록 회복되는 마나가 증가합니다. 한 번에 한 상만 취할 수 있습니다."},
