[415459] = {name = "주문 강화", additional_info = "[q]주문 강화 능력을 얻습니다.\n\n\n모든 주문이 치명타로 적중할 경우 보너스 피해가 50%만큼 증가합니다."},
[415460] = {name = "완전 연소", additional_info = "[q]완전 연소 능력을 얻습니다.\n\n\n모든 주문의 주문 극대화율이 15%만큼 증가하지만 비주기적인 주문이 극대화 효과를 발휘할 때 기본 마나의 1%를 추가로 소모합니다."},
[415467] = {name = "대규모 재생력", additional_info = "[q]대규모 재생력 능력을 얻습니다.\n\n\n대상 플레이어의 30미터 반경 내에 있는 모든 파티원을 3 sec에 걸쳐 [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3]만큼 치유하고 각 대상에게 15초 동안 시간의 봉화를 부여합니다.\n\n 시간의 봉화\n\n대상의 시공간 위치를 기록합니다. 시전자가 입히는 모든 비전 피해의 80%가 시간의 치유로 전환되어 현재 시간의 봉화가 부여된 각 대상을 치유합니다. 대상이 자신일 경우 치유량이 50%만큼 감소합니다. 또한 여러 대상을 공격하는 비전 주문으로 피해를 입힐 경우에는 치유량이 80%만큼 감소합니다."},
[415481] = {name = "고통과 고뇌", additional_info = "[q]고통과 고뇌 능력을 얻습니다.\n\n\n정신 분열 시전 시 대상에게 걸린 어둠의 권능: 고통의 지속시간이 최대 지속시간으로 갱신됩니다."},
[415596] = {name = "방패 숙련", additional_info = "[q]방패 숙련 능력을 얻습니다."},
[415598] = {name = "검투사 태세", additional_info = "[q]검투사 태세 능력을 얻습니다.\n\n\n공격적인 태세입니다. 방패를 착용한 동안 공격력이 10%만큼, 방패 막기 확률이 10%만큼 증가하지만 방어도가 30%만큼, 위협 생성 수준이 10%만큼 감소합니다.\n\n 검투사 태세로 방패를 착용하고 있는 동안에는 다른 태세로 제한되는 능력을 모두 사용할 수 있습니다."},
[415599] = {name = "하나된 분노", additional_info = "[q]하나된 분노 능력을 얻습니다.\n\n\n쌍수 무기 사용 시 물리 공격력과 이동 속도가 10%만큼 증가합니다."},
[415604] = {name = "영원한 고통", additional_info = "[q]영원한 고통 능력을 얻습니다.\n\n\n생명력 흡수, 영혼 흡수, 어둠의 화살, 어둠의 회전베기, 불타는 고통, 소각, 유령 출몰 시전 시 대상에게 걸린 부패의 지속시간이 최대 지속시간으로 갱신됩니다."},
[415605] = {name = "악마의 술책", additional_info = "[q]악마의 술책 능력을 얻습니다.\n\n\n흑마법사와 소환수의 근접 공격 및 주문 치명타 및 극대화율이 10%만큼 증가합니다."},
[415703] = {name = "성스러운 보호막", additional_info = "[q]성스러운 보호막 능력을 얻습니다.\n\n\n대상이 피해를 받을 때마다 [36 * (38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) / 100]의 피해를 흡수하고 최대 6 sec 동안 빛의 섬광 주문이 극대화 효과를 발휘할 확률을 50%만큼 증가시키는 성스러운 보호막 효과를 얻습니다. 추가로 빛의 섬광 시전 시 성스러운 보호막이 부여된 대상을 12 sec에 걸쳐 100%만큼 추가로 치유합니다. 이 효과는 최대 6초마다 한 번씩만 발동됩니다. 30 sec 동안 지속됩니다. 이 주문은 동시에 하나의 대상에만 사용할 수 있습니다."},
[415706] = {name = "전쟁의 기술", additional_info = "[q]전쟁의 기술 능력을 얻습니다.\n\n\n근접 치명타 적중 시 신성 충격 및 퇴마술의 재사용 대기시간이 초기화되고, 신성 충격 및 퇴마술의 마나 소모량이 80%만큼 감소합니다."},
[415709] = {name = "적자 생존", additional_info = "[q]적자 생존 능력을 얻습니다.\n\n\n근접 공격 치명타에 적중당할 확률이 6%만큼, 받는 모든 피해가 10%만큼 감소합니다. 곰 변신 또는 광포한 곰 변신 상태일 때 받는 피해가 추가로 10%만큼 감소합니다."},
[415712] = {name = "마력의 쇄도", additional_info = "[q]마력의 쇄도 능력을 얻습니다.\n\n\n 화염 충격으로 피해를 입힐 때마다 5%의 확률로 용암 폭발, 연쇄 번개의 재사용 대기시간이 초기화됩니다. 또한 10 sec 동안 시전하는 다음 용암 폭발, 연쇄 치유 또는 연쇄 번개가 즉시 시전됩니다. 추가로 5초마다 지능의 15%에 해당하는 마나를 회복합니다."},
[415713] = {name = "교묘한 정신", additional_info = "[q]교묘한 정신 능력을 얻습니다.\n\n\n근접 무기로 피해를 입히면 전투력이 지능의 100%만큼 증가합니다. 또한 10 sec 동안 주문 공격력과 치유량이 총 전투력의 30%만큼 증가합니다."},
[415714] = {name = "치유의 비", additional_info = "[q]치유의 비 능력을 얻습니다.\n\n\n대상 플레이어 주위 15미터 내에 있는 대상 플레이어의 파티원 모두를 1초마다 [(29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) * 15 / 100]만큼 치유합니다."},
[415717] = {name = "살쾡이의 반사 신경", additional_info = "[q]살쾡이의 반사 신경 능력을 얻습니다.\n\n\n자신의 회피 확률이 20%만큼, 야수의 회피 확률이 9%만큼 증가합니다. 추가로 살상 명령과 측방 강타 능력의 재사용 대기시간이 50%만큼 감소합니다."},
[415718] = {name = "독사의 상", additional_info = "[q]독사의 상 능력을 얻습니다.\n\n\n사냥꾼이 독사의 상을 취합니다. 이 동안에는 원거리 및 근접 자동 공격 시 마나를 회복하지만 전체 공격력이 10%만큼 감소합니다. 추가로 사냥꾼은 매 3초마다 전체 마나의 10%에 해당하는 마나를 얻습니다. 무기의 공격 속도가 빠를 수록 회복되는 마나가 증가합니다. 한 번에 한 상만 취할 수 있습니다."},
[415719] = {name = "실탄 장전", additional_info = "[q]실탄 장전 능력을 얻습니다.\n\n\n덫이 발동할 때마다 20 sec 안에 사용하는 다음 사격 능력이 마나를 소모하지 않고 재사용 대기시간을 발생시키지 않습니다."},
[415723] = {name = "근접 전투 전문가", additional_info = "[q]근접 전투 전문가 능력을 얻습니다.\n\n\n 랩터의 일격의 재사용 대기시간이 3초로 감소하고 즉시 시전됩니다. 살쾡이의 이빨의 재사용 대기시간이 사라지며, 랩터의 일격 사용 시 30%의 확률로 각 공격이 재사용 대기시간을 발동시키지 않습니다."},
[415725] = {name = "습격", additional_info = "[q]습격 능력을 얻습니다.\n\n\n매복과 기습이 적중하면 대상을 혼란스럽게 만들어 8 sec 동안 적의 근접 공격 간격을 10%만큼 늘리고 이동 속도를 50%만큼 감소시킵니다."},
[415729] = {name = "깨달음", additional_info = "[q]깨달음 능력을 얻습니다.\n\n\n마나가 70% 이상일 때 공격력이 10%만큼 증가합니다. 마나가 30% 미만일 때는 주문을 시전하는 동안에도 마나 회복 속도의 10%가 유지됩니다."},
[415734] = {name = "비전냉기 화살", additional_info = "[q]비전냉기 화살 능력을 얻습니다.\n\n\n적에게 비전냉기 화살을 발사하여 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 305 / 100 * ( 1 ) ]에서 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 355 / 100 * ( 1 ) ]의 비전냉기 피해를 입히고 9 sec 동안 이동 속도를 40%만큼 감소시킵니다. 이 주문은 대상의 냉기 및 비전 저항력 중 낮은 수치를 상대로 적중하며 냉기 및 비전 피해로 간주됩니다."},
[415737] = {name = "우연한 행운", additional_info = "[q]우연한 행운 능력을 얻습니다.\n\n\n순간 치유로 치유 시 20 sec 동안 다음 하급 치유, 치유, 상급 치유, 치유의 기원의 시전 시간이 20%만큼 감소합니다. 최대 3번까지 중첩됩니다."},
[415738] = {name = "정신 불태우기", additional_info = "[q]정신 불태우기 능력을 얻습니다.\n\n\n적 대상에 걸려있는 암흑 마법을 폭발시켜 대상으로부터 10미터 반경 내에 있는 모든 적들에게 5 sec 동안 매 1초마다 [70 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)]에서 [78 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)]의 암흑 피해를 입힙니다."},
[415739] = {name = "굳건한 정신", additional_info = "[q]하급 치유, 치유, 상급 치유, 순간 치유가 치유 대상에게 걸린 약화된 영혼의 남은 지속시간을 4초만큼 감소시킵니다. 추가로 신의 권능: 보호막 대상은 피해 흡수 보호막이 부여된 상태로 피해를 받아도 분노 효과를 얻으며, 정의의 격노는 신의 권능: 보호막으로 피해를 흡수했을 때 치유 효과를 받은 것처럼 발동합니다."},
[415740] = {name = "굳건한 정신", additional_info = "[q]굳건한 정신 능력을 얻습니다.\n\n\n하급 치유, 치유, 상급 치유, 순간 치유가 치유 대상에게 걸린 약화된 영혼의 남은 지속시간을 4초만큼 감소시킵니다. 추가로 신의 권능: 보호막 대상은 피해 흡수 보호막이 부여된 상태로 피해를 받아도 분노 효과를 얻으며, 정의의 격노는 신의 권능: 보호막으로 피해를 흡수했을 때 치유 효과를 받은 것처럼 발동합니다."},
[415743] = {name = "피 분출", additional_info = "[q]피 분출 능력을 얻습니다.\n\n\n 영웅의 일격, 피의 갈증, 소용돌이 사용 시 30%의 확률로 15 sec 안에 사용하는 다음 격돌이 즉시 시전되고 분노를 소모하지 않습니다."},
[415744] = {name = "정확한 시간 감각", additional_info = "[q]정확한 시간 감각 능력을 얻습니다.\n\n\n 격돌이 즉시 시전되지만 6초의 재사용 대기시간이 적용됩니다."},
[415745] = {name = "분노 집중", additional_info = "[q]분노 집중 능력을 얻습니다.\n\n\n공격 기술에 소비되는 분노가 3만큼 감소합니다."},
[415749] = {name = "악마의 지식", additional_info = "[q]악마의 지식 능력을 얻습니다.\n\n\n주문 공격력과 치유량이 악마 소환수의 총 체력과 지능을 합한 수치의 10%만큼 증가합니다."},
[415750] = {name = "소각", additional_info = "[q]소각 능력을 얻습니다.\n\n\n적을 불태워 [222 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)]에서 [258 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)]의 피해를 입히고 다음 15 sec 동안 모든 화염 공격력이 25%만큼 증가합니다."},
[415751] = {name = "악인의 춤", additional_info = "[q]악인의 춤 능력을 얻습니다.\n\n\n적에게 치명타 및 극대화 피해를 입힐 때마다 시전자와 악마 소환수가 주문 극대화율에 해당하는 회피 확률을 얻으며, 시전자와 소환수 모두 최대 마나의 2%를 회복합니다."},
[415755] = {name = "빛의 인도", additional_info = "[q]빛의 인도 능력을 얻습니다.\n\n\n근접 무기로 대상을 공격할 때마다 15 sec 동안 3초마다 최대 마나의 5%를 회복합니다. 하지만 마나를 회복하는 동안 빛의 섬광, 성스러운 빛, 신성 충격의 치유 효과가 50%만큼 감소합니다."},
[415756] = {name = "퇴마사", additional_info = "[q]퇴마사 능력을 얻습니다.\n\n\n퇴마를 모든 대상에게 시전할 수 있습니다. 또한 언데드와 악마에게 치명타 및 극대화 효과를 발휘할 확률이 100%만큼 증가합니다."},
[415759] = {name = "두개골 강타", additional_info = "[q]두개골 강타 능력을 얻습니다.\n\n\n13미터 내의 대상에게 돌진한 후 두개골을 강타하여 주문 시전을 방해하고, 2 sec 동안 같은 계열의 주문을 시전하지 못하게 합니다. 야성의 돌진과 재사용 대기시간을 공유합니다."},
[415760] = {name = "가르기", additional_info = "[q]가르기 능력을 얻습니다.\n\n\n대상을 갈라 출혈을 일으켜, 15 sec에 걸쳐 [(9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) * 20 / 100 * 5]의 피해를 입히고 대상에게 부여된 기존 가르기 중첩 하나당 무기 공격력의 20%에 해당하는 추가 피해를 입힙니다. 위협 수준이 크게 증가합니다. 한 대상에게 최대 5번까지 중첩됩니다."},
[415761] = {name = "살아있는 씨앗", additional_info = "[q]살아있는 씨앗 능력을 얻습니다.\n\n\n비주기적인 치유 주문이 극대화 효과를 발휘하면 대상에게 치유량의 50%에 해당하는 생명력을 회복시키는 살아있는 씨앗을 심습니다. 살아있는 씨앗은 다음에 대상이 피해를 받거나 비주기적인 치유를 받으면 피어납니다. 15 sec 동안 지속됩니다."},
[415762] = {name = "엘룬의 불꽃", additional_info = "[q]엘룬의 불꽃 능력을 얻습니다.\n\n\n일부 주문 및 능력 사용 시 대상에게 걸린 지속 피해 및 치유 효과의 지속시간이 증가합니다.\n\n 별빛 화살은 달빛 섬광의 지속시간을 6초만큼 증가시킵니다.\n 천벌은 태양 섬광의 지속시간을 3초만큼 증가시킵니다.\n 재생은 회복의 지속시간을 6초만큼 증가시킵니다\n 칼날 발톱은 도려내기의 지속시간을 2초만큼 증가시킵니다.\n\n 각 효과의 지속시간은 최대 3초만큼 증가합니다."},
[415768] = {name = "태우기", additional_info = "[q]태우기 능력을 얻습니다.\n\n\n화염 충격이 최대 3명의 대상을 가격합니다."},
[415816] = {name = "사기 고취", additional_info = "[q]사기 고취 능력을 얻습니다.\n\n\n 야수가 특수 공격으로 치명타를 적중시키면 즉시 최대 마나의 5%를 회복합니다."},
[415817] = {name = "신속한 사냥", additional_info = "[q]신속한 사냥 능력을 얻습니다.\n\n\n속사의 재사용 대기시간이 2분만큼 감소합니다. 또한 경험치 또는 명예 점수를 제공하는 적 처치 시 20 sec 동안 다음 사격 능력의 공격력이 20%만큼 증가합니다."},
[415818] = {name = "저격 훈련", additional_info = "[q]저격 훈련 능력을 얻습니다.\n\n\n지난 2초 동안 가만히 있었다면 사격 능력의 치명타 적중률이 2%만큼 증가합니다. 1초마다 중첩을 얻으며, 최대 5번까지 중첩됩니다. 이동 시 1초마다 중첩 1개를 잃습니다."},
[415822] = {name = "랩터의 격노", additional_info = "[q]랩터의 격노 능력을 얻습니다.\n\n\n랩터의 일격 사용 시 15 sec 동안 랩터의 일격 및 살쾡이의 이빨의 공격력이 15%만큼 증가합니다. 최대 5번까지 중첩됩니다. 후속으로 사용 시 이 효과의 지속시간이 증가하지 않습니다."},
[415926] = {name = "장화 각인술 - 습격", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 습격 룬을 새깁니다.\n\n\n매복과 기습이 적중하면 대상을 혼란스럽게 만들어 8 sec 동안 적의 근접 공격 간격을 10%만큼 늘리고 이동 속도를 50%만큼 감소시킵니다."},
[415934] = {name = "장화 각인술 - 주문 강화", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 주문 강화 룬을 새깁니다.\n\n\n모든 주문이 치명타로 적중할 경우 보너스 피해가 50%만큼 증가합니다."},
[415936] = {name = "장갑 각인술 - 살아있는 폭탄", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 살아있는 폭탄 룬을 새깁니다.\n\n\n대상은 살아있는 폭탄이 되어 12 sec에 걸쳐 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4]의 화염 피해를 입습니다. 12 sec 후, 혹은 주문이 무효화되면 대상은 폭발하여 10미터 반경 내에 있는 모든 적에게 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100]의 화염 피해를 입힙니다."},
[415939] = {name = "바지 각인술 - 대규모 재생력", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 대규모 재생력 룬을 새깁니다.\n\n\n대상 플레이어의 30미터 반경 내에 있는 모든 파티원을 3 sec에 걸쳐 [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3]만큼 치유하고 각 대상에게 15초 동안 시간의 봉화를 부여합니다.\n\n 시간의 봉화\n\n대상의 시공간 위치를 기록합니다. 시전자가 입히는 모든 비전 피해의 80%가 시간의 치유로 전환되어 현재 시간의 봉화가 부여된 각 대상을 치유합니다. 대상이 자신일 경우 치유량이 50%만큼 감소합니다. 또한 여러 대상을 공격하는 비전 주문으로 피해를 입힐 경우에는 치유량이 80%만큼 감소합니다."},
[415942] = {name = "가슴보호구 각인술 - 깨달음", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 깨달음 룬을 새깁니다.\n\n\n마나가 70% 이상일 때 공격력이 10%만큼 증가합니다. 마나가 30% 미만일 때는 주문을 시전하는 동안에도 마나 회복 속도의 10%가 유지됩니다."},
[415948] = {name = "허리띠 각인술 - 비전냉기 화살", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 비전냉기 화살 룬을 새깁니다.\n\n\n적에게 비전냉기 화살을 발사하여 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 305 / 100 * ( 1 ) ]에서 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 355 / 100 * ( 1 ) ]의 비전냉기 피해를 입히고 9 sec 동안 이동 속도를 40%만큼 감소시킵니다. 이 주문은 대상의 냉기 및 비전 저항력 중 낮은 수치를 상대로 적중하며 냉기 및 비전 피해로 간주됩니다."},
[415988] = {name = "바히 본스플리터 - 켄타우로스 머리를 룬 조각으로 교환", additional_info = nil},
[415991] = {name = "투구 각인술 - 고통과 고뇌", additional_info = "3 초 주문 시전 시간\n투구 필요\n[q]투구에 고통과 고뇌 룬을 새깁니다.\n\n\n정신 분열 시전 시 대상에게 걸린 어둠의 권능: 고통의 지속시간이 최대 지속시간으로 갱신됩니다."},
[415995] = {name = "가슴보호구 각인술 - 우연한 행운", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 우연한 행운 룬을 새깁니다.\n\n\n순간 치유로 치유 시 20 sec 동안 다음 하급 치유, 치유, 상급 치유, 치유의 기원의 시전 시간이 20%만큼 감소합니다. 최대 3번까지 중첩됩니다."},
[415996] = {name = "장갑 각인술 - 정신 불태우기", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 정신 불태우기 룬을 새깁니다.\n\n\n적 대상에 걸려있는 암흑 마법을 폭발시켜 대상으로부터 10미터 반경 내에 있는 모든 적들에게 5 sec 동안 매 1초마다 [70 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)]에서 [78 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)]의 암흑 피해를 입힙니다."},
[415997] = {name = "가슴보호구 각인술 - 굳건한 정신", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 굳건한 정신 룬을 새깁니다.\n\n\n하급 치유, 치유, 상급 치유, 순간 치유가 치유 대상에게 걸린 약화된 영혼의 남은 지속시간을 4초만큼 감소시킵니다. 추가로 신의 권능: 보호막 대상은 피해 흡수 보호막이 부여된 상태로 피해를 받아도 분노 효과를 얻으며, 정의의 격노는 신의 권능: 보호막으로 피해를 흡수했을 때 치유 효과를 받은 것처럼 발동합니다."},
[416002] = {name = "장화 각인술 - 검투사 태세", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 검투사 태세 룬을 새깁니다.\n\n\n공격적인 태세입니다. 방패를 착용한 동안 공격력이 10%만큼, 방패 막기 확률이 10%만큼 증가하지만 방어도가 30%만큼, 위협 생성 수준이 10%만큼 감소합니다.\n\n 검투사 태세로 방패를 착용하고 있는 동안에는 다른 태세로 제한되는 능력을 모두 사용할 수 있습니다."},
[416003] = {name = "장갑 각인술 - 하나된 분노", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 하나된 분노 룬을 새깁니다.\n\n\n쌍수 무기 사용 시 물리 공격력과 이동 속도가 10%만큼 증가합니다."},
[416004] = {name = "허리띠 각인술 - 피 분출", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 피 분출 룬을 새깁니다.\n\n\n 영웅의 일격, 피의 갈증, 소용돌이 사용 시 30%의 확률로 15 sec 안에 사용하는 다음 격돌이 즉시 시전되고 분노를 소모하지 않습니다."},
[416005] = {name = "허리띠 각인술 - 정확한 시간 감각", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 정확한 시간 감각 룬을 새깁니다.\n\n\n 격돌이 즉시 시전되지만 6초의 재사용 대기시간이 적용됩니다."},
[416008] = {name = "바지 각인술 - 영원한 고통", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 영원한 고통 룬을 새깁니다.\n\n\n생명력 흡수, 영혼 흡수, 어둠의 화살, 어둠의 회전베기, 불타는 고통, 소각, 유령 출몰 시전 시 대상에게 걸린 부패의 지속시간이 최대 지속시간으로 갱신됩니다."},
[416009] = {name = "가슴보호구 각인술 - 악마의 술책", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 악마의 술책 룬을 새깁니다.\n\n\n흑마법사와 소환수의 근접 공격 및 주문 치명타 및 극대화율이 10%만큼 증가합니다."},
[416014] = {name = "장화 각인술 - 악마의 지식", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 악마의 지식 룬을 새깁니다.\n\n\n주문 공격력과 치유량이 악마 소환수의 총 체력과 지능을 합한 수치의 10%만큼 증가합니다."},
[416015] = {name = "바지 각인술 - 소각", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 소각 룬을 새깁니다.\n\n\n적을 불태워 [222 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)]에서 [258 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)]의 피해를 입히고 다음 15 sec 동안 모든 화염 공격력이 25%만큼 증가합니다."},
[416017] = {name = "장화 각인술 - 악인의 춤", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 악인의 춤 룬을 새깁니다.\n\n\n적에게 치명타 및 극대화 피해를 입힐 때마다 시전자와 악마 소환수가 주문 극대화율에 해당하는 회피 확률을 얻으며, 시전자와 소환수 모두 최대 마나의 2%를 회복합니다."},
[416028] = {name = "장화 각인술 - 성스러운 보호막", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 성스러운 보호막 룬을 새깁니다.\n\n\n대상이 피해를 받을 때마다 [36 * (38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) / 100]의 피해를 흡수하고 최대 6 sec 동안 빛의 섬광 주문이 극대화 효과를 발휘할 확률을 50%만큼 증가시키는 성스러운 보호막 효과를 얻습니다. 추가로 빛의 섬광 시전 시 성스러운 보호막이 부여된 대상을 12 sec에 걸쳐 100%만큼 추가로 치유합니다. 이 효과는 최대 6초마다 한 번씩만 발동됩니다. 30 sec 동안 지속됩니다. 이 주문은 동시에 하나의 대상에만 사용할 수 있습니다."},
[416031] = {name = "장화 각인술 - 전쟁의 기술", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 전쟁의 기술 룬을 새깁니다.\n\n\n근접 치명타 적중 시 신성 충격 및 퇴마술의 재사용 대기시간이 초기화되고, 신성 충격 및 퇴마술의 마나 소모량이 80%만큼 감소합니다."},
[416035] = {name = "장화 각인술 - 빛의 인도", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 빛의 인도 룬을 새깁니다.\n\n\n근접 무기로 대상을 공격할 때마다 15 sec 동안 3초마다 최대 마나의 5%를 회복합니다. 하지만 마나를 회복하는 동안 빛의 섬광, 성스러운 빛, 신성 충격의 치유 효과가 50%만큼 감소합니다."},
[416037] = {name = "바지 각인술 - 퇴마사", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 퇴마사 룬을 새깁니다.\n\n\n퇴마를 모든 대상에게 시전할 수 있습니다. 또한 언데드와 악마에게 치명타 및 극대화 효과를 발휘할 확률이 100%만큼 증가합니다."},
[416042] = {name = "가슴보호구 각인술 - 적자 생존", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 적자 생존 룬을 새깁니다.\n\n\n근접 공격 치명타에 적중당할 확률이 6%만큼, 받는 모든 피해가 10%만큼 감소합니다. 곰 변신 또는 광포한 곰 변신 상태일 때 받는 피해가 추가로 10%만큼 감소합니다."},
[416044] = {name = "장갑 각인술 - 태양섬광", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 태양섬광 룬을 새깁니다.\n\n\n적을 불태워 [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]에서 [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]의 자연 피해를 입히고 12 sec에 걸쳐 [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]의 추가 자연 피해를 입힙니다.\n\n 추가로 곰 변신 또는 표범 변신 상태일 때 태양 섬광 능력을 얻고, 달빛 섬광이 태양 섬광 (곰) 또는 태양섬광 (표범)으로 대체됩니다. 이 주문은 달빛 섬광과 관련된 모든 이로운 효과를 적용 및 발동시킵니다.\n\n 태양섬광 (곰)\n적을 불태워 [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]에서 [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]의 자연 피해를 입히고 12 sec에 걸쳐 [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]의 추가 자연 피해를 입힙니다.\n\n 태양섬광 (표범)\n적을 불태워 [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]에서 [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]의 자연 피해를 입히고 12 sec에 걸쳐 [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]의 추가 자연 피해를 입힙니다. 연계 점수 1점을 생성합니다."},
[416046] = {name = "바지 각인술 - 두개골 강타", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 두개골 강타 룬을 새깁니다.\n\n\n13미터 내의 대상에게 돌진한 후 두개골을 강타하여 주문 시전을 방해하고, 2 sec 동안 같은 계열의 주문을 시전하지 못하게 합니다. 야성의 돌진과 재사용 대기시간을 공유합니다."},
[416049] = {name = "장갑 각인술 - 가르기", additional_info = "3 초 주문 시전 시간\n장갑 필요\n[q]장갑에 가르기 룬을 새깁니다.\n\n\n대상을 갈라 출혈을 일으켜, 15 sec에 걸쳐 [(9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) * 20 / 100 * 5]의 피해를 입히고 대상에게 부여된 기존 가르기 중첩 하나당 무기 공격력의 20%에 해당하는 추가 피해를 입힙니다. 위협 수준이 크게 증가합니다. 한 대상에게 최대 5번까지 중첩됩니다."},
[416050] = {name = "가슴보호구 각인술 - 살아있는 씨앗", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 살아있는 씨앗 룬을 새깁니다.\n\n\n비주기적인 치유 주문이 극대화 효과를 발휘하면 대상에게 치유량의 50%에 해당하는 생명력을 회복시키는 살아있는 씨앗을 심습니다. 살아있는 씨앗은 다음에 대상이 피해를 받거나 비주기적인 치유를 받으면 피어납니다. 15 sec 동안 지속됩니다."},
[416051] = {name = "팔보호구 각인술 - 엘룬의 불꽃", additional_info = "3 초 주문 시전 시간\n손목보호구 필요\n[q]팔보호구에 엘룬의 불꽃 룬을 새깁니다.\n\n\n일부 주문 및 능력 사용 시 대상에게 걸린 지속 피해 및 치유 효과의 지속시간이 증가합니다.\n\n 별빛 화살은 달빛 섬광의 지속시간을 6초만큼 증가시킵니다.\n 천벌은 태양 섬광의 지속시간을 3초만큼 증가시킵니다.\n 재생은 회복의 지속시간을 6초만큼 증가시킵니다\n 칼날 발톱은 도려내기의 지속시간을 2초만큼 증가시킵니다.\n\n 각 효과의 지속시간은 최대 3초만큼 증가합니다."},
[416054] = {name = "허리띠 각인술 - 마력의 쇄도", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 마력의 쇄도 룬을 새깁니다.\n\n\n 화염 충격으로 피해를 입힐 때마다 5%의 확률로 용암 폭발, 연쇄 번개의 재사용 대기시간이 초기화됩니다. 또한 10 sec 동안 시전하는 다음 용암 폭발, 연쇄 치유 또는 연쇄 번개가 즉시 시전됩니다. 추가로 5초마다 지능의 15%에 해당하는 마나를 회복합니다."},
[416055] = {name = "투구 각인술 - 교묘한 정신", additional_info = "3 초 주문 시전 시간\n투구 필요\n[q]투구에 교묘한 정신 룬을 새깁니다.\n\n\n근접 무기로 피해를 입히면 전투력이 지능의 100%만큼 증가합니다. 또한 10 sec 동안 주문 공격력과 치유량이 총 전투력의 30%만큼 증가합니다."},
[416057] = {name = "가슴보호구 각인술 - 치유의 비", additional_info = "3 초 주문 시전 시간\n가슴, 가슴 필요\n[q]가슴보호구 또는 로브에 치유의 비 룬을 새깁니다.\n\n대상 플레이어 주위 15미터 내에 있는 대상 플레이어의 파티원 모두를 1초마다 [(29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) * 15 / 100]만큼 치유합니다."},
[416066] = {name = "투구 각인술 - 태우기", additional_info = "3 초 주문 시전 시간\n투구 필요\n[q]투구에 태우기 룬을 새깁니다.\n\n\n화염 충격이 최대 3명의 대상을 가격합니다."},
[416083] = {name = "투구 각인술 - 살쾡이의 반사 신경", additional_info = "3 초 주문 시전 시간\n투구 필요\n[q]투구에 살쾡이의 반사 신경 룬을 새깁니다.\n\n\n자신의 회피 확률이 20%만큼, 야수의 회피 확률이 9%만큼 증가합니다. 추가로 살상 명령과 측방 강타 능력의 재사용 대기시간이 50%만큼 감소합니다."},
[416084] = {name = "허리띠 각인술 - 독사의 상", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 독사의 상 룬을 새깁니다.\n\n\n사냥꾼이 독사의 상을 취합니다. 이 동안에는 원거리 및 근접 자동 공격 시 마나를 회복하지만 전체 공격력이 10%만큼 감소합니다. 추가로 사냥꾼은 매 3초마다 전체 마나의 10%에 해당하는 마나를 얻습니다. 무기의 공격 속도가 빠를 수록 회복되는 마나가 증가합니다. 한 번에 한 상만 취할 수 있습니다."},
[416085] = {name = "투구 각인술 - 실탄 장전", additional_info = "3 초 주문 시전 시간\n투구 필요\n[q]투구에 실탄 장전 룬을 새깁니다.\n\n\n덫이 발동할 때마다 20 sec 안에 사용하는 다음 사격 능력이 마나를 소모하지 않고 재사용 대기시간을 발생시키지 않습니다."},
[416086] = {name = "허리띠 각인술 - 근접 전투 전문가", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 근접 전투 전문가 룬을 새깁니다.\n\n\n 랩터의 일격의 재사용 대기시간이 3초로 감소하고 즉시 시전됩니다. 살쾡이의 이빨의 재사용 대기시간이 사라지며, 랩터의 일격 사용 시 30%의 확률로 각 공격이 재사용 대기시간을 발동시키지 않습니다."},
[416089] = {name = "장화 각인술 - 사기 고취", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 사기 고취 룬을 새깁니다.\n\n\n 야수가 특수 공격으로 치명타를 적중시키면 즉시 최대 마나의 5%를 회복합니다."},
[416090] = {name = "투구 각인술 - 신속한 사냥", additional_info = "3 초 주문 시전 시간\n투구 필요\n[q]투구에 신속한 사냥 룬을 새깁니다.\n\n\n속사의 재사용 대기시간이 2분만큼 감소합니다. 또한 경험치 또는 명예 점수를 제공하는 적 처치 시 20 sec 동안 다음 사격 능력의 공격력이 20%만큼 증가합니다."},
[416091] = {name = "바지 각인술 - 저격 훈련", additional_info = "3 초 주문 시전 시간\n바지 필요\n[q]바지에 저격 훈련 룬을 새깁니다.\n\n\n지난 2초 동안 가만히 있었다면 사격 능력의 치명타 적중률이 2%만큼 증가합니다. 1초마다 중첩을 얻으며, 최대 5번까지 중첩됩니다. 이동 시 1초마다 중첩 1개를 잃습니다."},
[416093] = {name = "팔보호구 각인술 - 랩터의 격노", additional_info = "3 초 주문 시전 시간\n손목보호구 필요\n[q]팔보호구에 랩터의 격노 룬을 새깁니다.\n\n\n랩터의 일격 사용 시 15 sec 동안 랩터의 일격 및 살쾡이의 이빨의 공격력이 15%만큼 증가합니다. 최대 5번까지 중첩됩니다. 후속으로 사용 시 이 효과의 지속시간이 증가하지 않습니다."},
[416116] = {name = "물의 정령 능력치 조정", additional_info = nil},
[416153] = {name = "어둠의 마귀 능력치 조정", additional_info = nil},
[416186] = {name = "바소 - 편지를 룬으로 교환", additional_info = nil},
[416189] = {name = "흑마법사 소환수 크기", additional_info = nil},
[416244] = {name = "연쇄 치유", additional_info = "40 야드 사정거리\n즉시\n[q]대상의 생명력을 166 to 191만큼 회복시키고 그 주위의 아군을 연쇄적으로 회복시킵니다. 파티원에게 사용하면 같은 파티원에게만 효과가 전달됩니다. 대상이 바뀔 때마다 이전 대상 대비 50%의 효율을 발휘합니다. 최대 3명의 대상에게 효력을 미칩니다."},
[416245] = {name = "연쇄 치유", additional_info = "40 야드 사정거리\n즉시\n[q]대상의 생명력을 210 to 240만큼 회복시키고 그 주위의 아군을 연쇄적으로 회복시킵니다. 파티원에게 사용하면 같은 파티원에게만 효과가 전달됩니다. 대상이 바뀔 때마다 이전 대상 대비 50%의 효율을 발휘합니다. 최대 3명의 대상에게 효력을 미칩니다."},
[416246] = {name = "연쇄 치유", additional_info = "40 야드 사정거리\n즉시\n[q]대상의 생명력을 283 to 324만큼 회복시키고 그 주위의 아군을 연쇄적으로 회복시킵니다. 파티원에게 사용하면 같은 파티원에게만 효과가 전달됩니다. 대상이 바뀔 때마다 이전 대상 대비 50%의 효율을 발휘합니다. 최대 3명의 대상에게 효력을 미칩니다."},
