[417141] = {name = "광폭화", additional_info = "즉시 3 분 재사용 대기시간\n[q]활성화되면 짓이기기 (곰) 및 가르기 기술이 최대 3명의 대상을 공격하며, 가르기가 분노를 소모하지 않고, 짓이기기 (곰)의 재사용 대기시간이 발생하지 않습니다. 또한 표범 변신 상태에서 기술 사용 시 소모되는 기력이 50%만큼 감소합니다. 15 sec 동안 지속됩니다. 곰 변신, 표범 변신, 광포한 곰 변신 상태일 때 활성화할 수 있습니다.\n\n 광포화되면 즉시 공포 효과에서 벗어나고 효과가 지속되는 동안 공포에 면역이 됩니다."},
