[417146] = {name = "꽃피우기", additional_info = nil},
[417147] = {name = "꽃피우기", additional_info = "100 야드 사정거리\n즉시 10 초 재사용 대기시간\n[q]해당 지역에서 15미터 내에 있는 모든 파티원 또는 공격대원을 5초마다 [(38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60) * 16 / 100]만큼 치유합니다. 15 sec 동안 지속됩니다."},
