[417437] = {name = "난타 (표범)", additional_info = nil},
[417440] = {name = "난타 (곰)", additional_info = "분노 10 8 야드 사정거리\n즉시 시전 6 초 재사용 대기시간\n곰 변신, 광포한 곰 변신 필요\n[q]주위의 모든 적을 공격하여 [45 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100 + 0.092 * Attack power]의 출혈 피해를 입히고, 추가로 15 sec에 걸쳐 [12 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100 * 5 + 0.125 * Attack power]의 출혈 피해를 입힙니다. 곰 변신 상태에서 사용하면 최대 3번까지 중첩됩니다."},
[417441] = {name = "난타 (곰)", additional_info = nil},
[417448] = {name = "난타 (표범)", additional_info = "기력 40 8 야드 사정거리\n즉시\n표범 변신 필요\n[q]주위의 모든 적을 공격하여 [60 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100 + 0.104 * Attack power]의 출혈 피해를 입히고, 추가로 15 sec에 걸쳐 [40 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100 * 5 + 0.0661 * 5 * Attack power]의 출혈 피해를 입힙니다. 연계 점수 1점을 생성합니다."},
[417450] = {name = "난타 (표범)", additional_info = nil},
[417453] = {name = "난타 (표범)", additional_info = "[q]새로운 악마 능력 분열, 악마의 돌진, 악마의 포효, 불지옥 일격을 배웁니다.\n\n\n쇄도하는 암흑 마력으로 적의 숨통을 틀어막아 10의 피해를 입히고 주문 시전을 차단합니다. 대상이 5 sec 동안 같은 계열의 주문을 시전하는 것을 방해합니다.\n\n\n적에게 돌진하여 1 sec 동안 기절시킵니다. 전투 중에는 사용할 수 없습니다.\n\n\n6 sec 동안 주위 모든 적이 자신에게 공격을 집중하도록 만듭니다.\n\n\n공중 도약 후 지면에 강력한 충격을 일으켜 대상 지역의 8미터 내에 있는 모든 적에게 100의 암흑 피해를 입히고 2 sec 동안 기절시킵니다."},
