[425307] = {name = "분산", additional_info = "[q]분산 능력을 얻습니다.\n\n\n순수한 암흑의 에너지로 흩어져, 받는 모든 피해를 90%만큼 감소시킵니다. 이 동안에는 공격하거나 주문을 시전할 수 없습니다. 매 1초마다 6%의 마나를 회복합니다. 6 sec 동안 지속됩니다. 기절, 공포, 침묵 효과에 걸려 있는 동안 시전할 수 있고 모든 이동 방해 효과와 감속 효과를 제거하며 활성화되어 있는 동안 해당 효과에 면역이 됩니다."},
[425309] = {name = "허리띠 각인술 - 소생 강화", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 소생 강화 룬을 새깁니다.\n\n\n 소생 부여 시 즉시 한 번 더 생명력을 회복시킵니다. 또한 시전자의 추가 치유 효과로 생명력을 회복할 때마다 효과가 15%만큼 증가합니다.\n\n 추가로 다른 사제의 소생에 영향을 받는 대상에게 소생을 걸 수 있습니다."},
[425310] = {name = "허리띠 각인술 - 새로운 희망", additional_info = "3 초 주문 시전 시간\n허리띠 필요\n[q]허리띠에 새로운 희망 룬을 새깁니다.\n\n\n약화된 영혼이 부여된 대상에게 순간 치유, 하급 치유, 치유, 상급 치유, 회개 시전 시 치유 효과가 10%의 확률로 극대화 효과를 발휘합니다."},
[425312] = {name = "장화 각인술 - 구원자의 영혼", additional_info = "3 초 주문 시전 시간\n장화 필요"},
[425314] = {name = "장화 각인술 - 분산", additional_info = "3 초 주문 시전 시간\n장화 필요\n[q]장화에 분산 룬을 새깁니다.\n\n\n순수한 암흑의 에너지로 흩어져, 받는 모든 피해를 90%만큼 감소시킵니다. 이 동안에는 공격하거나 주문을 시전할 수 없습니다. 매 1초마다 6%의 마나를 회복합니다. 6 sec 동안 지속됩니다. 기절, 공포, 침묵 효과에 걸려 있는 동안 시전할 수 있고 모든 이동 방해 효과와 감속 효과를 제거하며 활성화되어 있는 동안 해당 효과에 면역이 됩니다."},
[425321] = {name = "그늘숲 반지 - 룬 부여", additional_info = nil},
[425336] = {name = "주술의 분노", additional_info = "즉시 1 분 재사용 대기시간\n[q]받는 모든 피해가 20%만큼 감소하고 15 sec 동안 1초마다 최대 마나의 5%에 해당하는 마나를 회복합니다. 이 방식으로 마나를 회복할 때 자신의 40미터 내에 있는 파티원과 공격대원도 20%만큼 마나를 회복합니다."},
[425339] = {name = "용암 작열", additional_info = "18% (기본 마나 중)\n즉시 6 초 재사용 대기시간\n[q]전방 부채꼴 범위 내의 적 최대 4명을 강타하여 [(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 72 / 100 + 5 / 100 * Attack power]에서 [(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 108 / 100 + 5 / 100 * Attack power]의 화염 피해를 입힙니다. 이 능력은 높은 위협 수준을 생성합니다. 화염 충격의 주기적인 피해가 10%의 확률로 용암 작열의 재사용 대기시간을 초기화합니다."},
[425340] = {name = "용암 작열", additional_info = "[q]용암 작열 능력을 얻습니다.\n\n\n전방 부채꼴 범위 내의 적 최대 4명을 강타하여 [(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 72 / 100 + 5 / 100 * Attack power]에서 [(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 108 / 100 + 5 / 100 * Attack power]의 화염 피해를 입힙니다. 이 능력은 높은 위협 수준을 생성합니다. 화염 충격의 주기적인 피해가 10%의 확률로 용암 작열의 재사용 대기시간을 초기화합니다."},
[425341] = {name = "주술의 분노", additional_info = "[q]주술의 분노 능력을 얻습니다.\n\n\n받는 모든 피해가 20%만큼 감소하고 15 sec 동안 1초마다 최대 마나의 5%에 해당하는 마나를 회복합니다. 이 방식으로 마나를 회복할 때 자신의 40미터 내에 있는 파티원과 공격대원도 20%만큼 마나를 회복합니다."},
