[429145] = {name = "신의 격노", additional_info = "마나 6452 초 주문 시전 시간 1 분 재사용 대기시간\n[q]사방으로 신성한 힘의 섬광을 내뿜어 20미터 반경 내의 모든 대상에게 368 to 435의 신성 피해를 입히고 악마와 언데드 대상을 2 sec 동안 기절시킵니다."},
