[429245] = {name = "성역 연마", additional_info = "[q]성역 연마 능력을 얻습니다.\n\n\n성역의 축복이 방지하는 피해가 100%만큼 증가합니다. 또한 성역의 축복의 공격력이 방패 막기의 30%만큼 증가합니다."},
[429247] = {name = "투구 각인술 - 성역 연마", additional_info = "3 초 주문 시전 시간\n투구 필요\n[q]투구에 성역 연마 룬을 새깁니다.\n\n\n성역의 축복이 방지하는 피해가 100%만큼 증가합니다. 또한 성역의 축복의 공격력이 방패 막기의 30%만큼 증가합니다."},
[429248] = {name = "천벌", additional_info = "[q]천벌 능력을 얻습니다.\n\n\n신성화 피해가 극대화 효과를 발휘할 수 있습니다. 또한 퇴마술, 신성 충격, 신의 격노, 신성화 주문으로 피해를 입히면 치명타 및 극대화율이 근접 치명타 및 극대화율만큼 증가합니다."},
