[429254] = {name = "정화의 힘", additional_info = "[q]정화의 힘 능력을 얻습니다.\n\n\n퇴마술과 신의 격노의 재사용 대기시간이 50%만큼 감소합니다. 또한 신의 격노를 아무 대상에게 시전할 수 있으며 언데드와 악마 대상을 2 sec 동안 기절시킵니다."},
[429255] = {name = "팔보호구 각인술 - 정화의 힘", additional_info = "3 초 주문 시전 시간\n손목보호구 필요\n[q]팔보호구에 정화의 힘 룬을 새깁니다.\n\n\n퇴마술과 신의 격노의 재사용 대기시간이 50%만큼 감소합니다. 또한 신의 격노를 아무 대상에게 시전할 수 있으며 언데드와 악마 대상을 2 sec 동안 기절시킵니다."},
[429259] = {name = "천벌의 망치 연마", additional_info = "[q]천벌의 망치 연마 능력을 얻습니다.\n\n\n 천벌의 망치가 즉시 시전되며, 천벌의 망치로 생명력이 10% 미만인 적에게 피해를 입힐 때마다 재사용 대기시간이 초기화됩니다."},
[429261] = {name = "팔보호구 각인술 - 천벌의 망치 연마", additional_info = "3 초 주문 시전 시간\n손목보호구 필요\n[q]팔보호구에 천벌의 망치 룬을 새깁니다.\n\n\n 천벌의 망치가 즉시 시전되며, 천벌의 망치로 생명력이 10% 미만인 적에게 피해를 입힐 때마다 재사용 대기시간이 초기화됩니다."},
[429283] = {name = "병균 확산", additional_info = "[q]병균 확산 능력을 얻습니다.\n\n\n부패, 불안정한 고통, 고통의 저주, 제물, 파멸의 저주, 생명력 착취 능력의 주기적인 피해가 치명타 및 극대화 효과를 발휘할 수 있도록 합니다."},
[429303] = {name = "동결", additional_info = "[q]동결 능력을 얻습니다.\n\n\n5 sec 동안 대상을 기절시킵니다. 얼어붙은 대상에게만 사용할 수 있습니다. 기절에 면역인 대상에게는 [462 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100 * ( 1 ) ]에서 [538 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100 * ( 1 ) ]의 피해를 입힙니다."},
[429304] = {name = "투구 각인술 - 동결", additional_info = "3 초 주문 시전 시간\n투구 필요\n[q]투구에 동결 룬을 새깁니다.\n\n\n5 sec 동안 대상을 기절시킵니다. 얼어붙은 대상에게만 사용할 수 있습니다. 기절에 면역인 대상에게는 [462 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100 * ( 1 ) ]에서 [538 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100 * ( 1 ) ]의 피해를 입힙니다."},
[429305] = {name = "시간 변칙", additional_info = "[q]시간 변칙 능력을 얻습니다.\n\n\n시간 마력의 구슬을 발사합니다. 구슬은 전방으로 천천히 이동하며 2초마다 주위 모든 파티원에게 15 sec 동안 [100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100]의 피해 흡수 보호막을 부여합니다."},
[429306] = {name = "투구 각인술 - 시간 변칙", additional_info = "3 초 주문 시전 시간\n투구 필요\n[q]투구에 시간 변칙 룬을 새깁니다.\n\n\n시간 마력의 구슬을 발사합니다. 구슬은 전방으로 천천히 이동하며 2초마다 주위 모든 파티원에게 15 sec 동안 [100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) / 100]의 피해 흡수 보호막을 부여합니다."},
[429307] = {name = "타오르는 갑옷", additional_info = "[q]타오르는 갑옷 능력을 얻습니다.\n\n\n가격 당했을 때 공격자에게 [10 / 100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60)]의 화염 피해를 입히고 주문 극대화율이 5%만큼 증가하며 치명타 공격에 적중 당할 확률이 5%만큼 감소합니다. 마법사의 갑옷 주문은 동시에 한 종류만 사용할 수 있습니다. 30 min 동안 지속됩니다."},
[429308] = {name = "팔보호구 각인술 - 타오르는 갑옷", additional_info = "3 초 주문 시전 시간\n손목보호구 필요\n[q]팔보호구에 타오르는 갑옷 룬을 새깁니다.\n\n\n가격 당했을 때 공격자에게 [10 / 100 * (13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60)]의 화염 피해를 입히고 주문 극대화율이 5%만큼 증가하며 치명타 공격에 적중 당할 확률이 5%만큼 감소합니다. 마법사의 갑옷 주문은 동시에 한 종류만 사용할 수 있습니다. 30 min 동안 지속됩니다."},
[429309] = {name = "팔보호구 각인술 - 변위", additional_info = "3 초 주문 시전 시간\n손목보호구 필요\n[q]팔보호구에 변위 룬을 새깁니다.\n\n\n점멸을 사용한 출발점으로 다시 돌아가고, 점멸의 재사용 대기시간을 초기화시킵니다. 점멸 시전 후 10 sec 동안만 사용할 수 있습니다."},
[429310] = {name = "재앙불꽃 화살", additional_info = "[q]재앙불꽃 화살 능력을 얻습니다.\n\n\n 적에게 현실을 뒤트는 순수한 마력을 방출해 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 280 / 100]에서 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 420 / 100]의 비전화염 피해를 입힙니다. 재앙불꽃 화살을 시전할 때마다 다음 30 sec 내로 시전하는 재앙불꽃 화살의 공격력이 10%만큼 증가하고 30 sec 동안 정신력이 10%만큼 감소합니다. 두 효과 모두 최대 10번까지 중첩됩니다. 정신력이 0에 도달할 경우 즉시 사망합니다. 이 주문은 대상의 비전 및 화염 저항력 중 더 낮은 수치에 영향을 받습니다."},
[429311] = {name = "팔보호구 각인술 - 재앙불꽃 화살", additional_info = "3 초 주문 시전 시간\n손목보호구 필요\n[q]팔보호구에 재앙불꽃 화살 룬을 새깁니다.\n\n\n 적에게 현실을 뒤트는 순수한 마력을 방출해 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 280 / 100]에서 [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 420 / 100]의 비전화염 피해를 입힙니다. 재앙불꽃 화살을 시전할 때마다 다음 30 sec 내로 시전하는 재앙불꽃 화살의 공격력이 10%만큼 증가하고 30 sec 동안 정신력이 10%만큼 감소합니다. 두 효과 모두 최대 10번까지 중첩됩니다. 정신력이 0에 도달할 경우 즉시 사망합니다. 이 주문은 대상의 비전 및 화염 저항력 중 더 낮은 수치에 영향을 받습니다."},
