[429348] = {name = "[q4]변화무쌍한 은미늘 흉갑", additional_info = "45 초 주문 시전 시간\n도구:\n대장장이 망치\n재료:\n빛나는 은미늘 흉갑 , 공허의 편린\n[q4]변화무쌍한 은미늘 흉갑\n획득 시 귀속\n고유 장착 아이템: [Void-Touched] (1)가슴 사슬\n방어도 238\n힘 +12\n체력 +5\n내구도 145 / 145\n25\n대장기술\n(100) 필요\n[q2]착용 효과: 이 물품은 순수한 공허의 힘이 주입되어 있습니다. 착용자가 공격받으면 이 아이템이 높은 확률로 끔찍한 저주를 일으켜 15초 동안 공격자가 받는 모든 피해를 증가시킵니다. (효과 발동 확률: 25%)\n[q2]착용 효과: 모든 주문과 공격의 적중률이 1%만큼 증가합니다."},
