[429351] = {name = "[q4]다른 차원의 거미줄 장화", additional_info = "45 초 주문 시전 시간\n재료:\n공허의 편린 , 거미줄 장화\n[q4]다른 차원의 거미줄 장화\n획득 시 귀속\n고유 장착 아이템: [Void-Touched] (1)발 천\n방어도 35\n체력 +5\n지능 +5\n정신력 +6\n내구도 50 / 50\n25\n재봉술\n(100) 필요\n[q2]사용 효과: 일시적으로 다른 차원에 들어가 즉시 위협 수준을 완화하고 6 sec초 동안 받는 모든 피해가 30%만큼 감소합니다. (10 분 재사용 대기시간)\n[q2]착용 효과: 모든 주문 및 효과에 의한 피해와 치유량이 최대 7만큼 증가합니다.\n[q2]착용 효과: 모든 주문과 공격의 적중률이 1%만큼 증가합니다."},
