[429748] = {name = "속전속결", additional_info = "[q]영웅의 일격을 속전속결로 대체합니다.\n\n\n 즉시 양손 무기로 무모한 근접 공격을 날려 (Attack power * 10 / 100)에서 (Attack power * 20 / 100)의 물리 피해를 입힙니다. 이 능력은 영웅의 일격과 관련된 모든 이로운 효과를 적용 및 발동시킵니다."},
[429765] = {name = "속전속결", additional_info = "분노 20 근접 사정거리\n즉시 시전\n양손 필요\n[q]즉시 양손 무기로 무모한 근접 공격을 날려 (Attack power * 10 / 100)에서 (Attack power * 20 / 100)의 물리 피해를 입힙니다. 이 능력은 영웅의 일격과 관련된 모든 이로운 효과를 적용 및 발동시킵니다."},
[429820] = {name = "별똥별", additional_info = "30 야드 사정거리\n집중 (10 초 주문 시전 시간)\n[q]10 sec 동안 선택한 지역의 모든 적에게 매 2초마다 118 to 132의 비전 피해를 입힙니다."},
[429821] = {name = "이글거리는 화살", additional_info = "50 야드 사정거리\n원거리 무기 필요\n재료:\n불붙인 타르\n[q]적에게 화염 화살을 발사하여 무기 공격력에 추가로 150의 피해를 입힙니다. 모든 피해는 화염 피해로 간주됩니다."},
[429822] = {name = "회전베기", additional_info = "15 야드 사정거리\n다음 근접\n[q]목표 적과 그 주위의 적에게 일반 피해를 입힙니다. 최대 5개의 대상에게 영향을 미칩니다."},
[429823] = {name = "달빛 섬광", additional_info = "15% (기본 마나 중) 50 야드 사정거리\n즉시\n[q]적에게 285 to 315의 비전 피해를 입히고 12 sec에 걸쳐 매 3초마다 71 to 79의 추가 피해를 입힙니다."},
[429825] = {name = "연쇄 번개", additional_info = "30 야드 사정거리3 초 주문 시전 시간 6 초 재사용 대기시간\n[q]주위 적을 연이어 공격하는 번개 화살로 대상을 강타합니다. 최대 80개의 목표를 가격하여 각각 막대한 자연 피해를 입힙니다."},
